    public int kSimilarity(String a, String b) {
        if (a.equals(b)) {
            return 0;
        }

        int n = a.length();
        Queue<String> queue = new LinkedList<>();
        queue.offer(a);
        boolean[] visited = new boolean[1 << n];
        visited[0] = true;

        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                String curr = queue.poll();
                if (curr.equals(b)) {
                    return steps;
                }

                int j = 0;
