                groups++;
            }
        }

        return groups;
    }

    private boolean areSimilar(String s1, String s2) {
        int diff = 0;
        int[] diffIndices = new int[2];
        for (int i = 0; i < s1.length(); i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                if (diff == 2) {
                    return false;
                }
                diffIndices[diff] = i;
                diff++;
            }
        }
        return diff == 0 || (diff == 2 && s1.charAt(diffIndices[0]) == s2.charAt(diffIndices[1]) && s1.charAt(diffIndices[1]) == s2.charAt(diffIndices[0]));
    }

    private int find(int[] parent, int i) {
        if (parent[i] == i) {
            return i;
        }
        return parent[i] = find(parent, parent[i]);
    }

    private void union(int[] parent, int i, int j) {
        int rootI = find(parent, i);
        int rootJ = find(parent, j);
        if (rootI != rootJ) {
            parent[rootI] = rootJ;
        }
    }
}

