import java.util.Collections;

public class Solution {
    public int rectangleArea(int[][] rectangles) {
        List<int[]> events = new ArrayList<>();
        for (int[] rect : rectangles) {
            events.add(new int[]{rect[0], rect[1], rect[3], 1}); // Start event
            events.add(new int[]{rect[2], rect[1], rect[3], -1}); // End event
        }

        Collections.sort(events, (a, b) -> a[0] - b[0]);

        List<Integer> yCoords = new ArrayList<>();
        for (int[] rect : rectangles) {
            yCoords.add(rect[1]);
            yCoords.add(rect[3]);
        }
        Collections.sort(yCoords);

        int[] active = new int[yCoords.size() - 1];
        long area = 0;
        int prevX = 0;
        int mod = 1000000007;

        for (int[] event : events) {
            int x = event[0];
            int y1 = event[1];
            int y2 = event[2];
            int type = event[3];

            int startYIndex = -1;
            int endYIndex = -1;

            for (int i = 0; i < yCoords.size() - 1; i++) {
                if (yCoords.get(i) == y1 && yCoords.get(i + 1) == y2) {
                    startYIndex = i;
                    endYIndex = i;
                    break;
                }
                if (yCoords.get(i) == y1) {
                    startYIndex = i;
                }
                if (yCoords.get(i + 1) == y2) {
                    endYIndex = i;
                }
            }

            if (startYIndex == -1 || endYIndex == -1) {
                for (int i = 0; i < yCoords.size() - 1; i++) {
                    if (yCoords.get(i) >= y1 && yCoords.get(i + 1) <= y2) {
                        startYIndex = i;
                        endYIndex = i;
                        break;
                    }
                }
            }

            if (startYIndex == -1) {
                startYIndex = 0;
            }
            if (endYIndex == -1) {
                endYIndex = yCoords.size() - 2;
            }

            for (int i = startYIndex; i <= endYIndex; i++) {
                active[i] += type;
            }

            long width = x - prevX;
            long height = 0;
            for (int i = 0; i < yCoords.size() - 1; i++) {
                if (active[i] > 0) {
                    height += yCoords.get(i + 1) - yCoords.get(i);
                }
            }

            area = (area + (width * height) % mod) % mod;
            prevX = x;
        }

        return (int) area;
    }
}

