import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
public class Solution {
    public long[] treeDistance(int n, int[][] edges) {
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        long[] distances = new long[n];
        for (int i = 0; i < n; i++) {
            distances[i] = calculateTotalDistance(i, adj, n);
        }

        return distances;
    }

    private long calculateTotalDistance(int startNode, List<List<Integer>> adj, int n) {
        long totalDistance = 0;
        int[] dist = new int[n];
        Arrays.fill(dist, -1);
        dist[startNode] = 0;

        List<Integer> queue = new ArrayList<>();
        queue.add(startNode);

        int head = 0;
        while (head < queue.size()) {
            int u = queue.get(head++);

            for (int v : adj.get(u)) {
                if (dist[v] == -1) {
                    dist[v] = dist[u] + 1;
                    queue.add(v);
                }
            }
        }

        for (int i = 0; i < n; i++) {
            totalDistance += (long) dist[i];
        }

        return totalDistance;
    }
}

