import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;
import java.util.HashMap;
import java.util.Map;
public class Solution {
    public List<Integer> distanceK(TreeNode root, TreeNode target, int k) {
        Map<TreeNode, TreeNode> parentMap = new HashMap<>();
        dfs(root, null, parentMap);

        List<Integer> result = new ArrayList<>();
        dfs(target, k, parentMap, result);

        return result;
    }

    private void dfs(TreeNode node, TreeNode parent, Map<TreeNode, TreeNode> parentMap) {
        if (node == null) {
            return;
        }

        parentMap.put(node, parent);

        dfs(node.left, node, parentMap);
        dfs(node.right, node, parentMap);
    }

    private void dfs(TreeNode node, int k, Map<TreeNode, TreeNode> parentMap, List<Integer> result) {
        if (node == null || k < 0) {
            return;
        }

        if (k == 0) {
            result.add(node.val);
            return;
        }

        dfs(node.left, k - 1, parentMap, result);
        dfs(node.right, k - 1, parentMap, result);

        TreeNode parent = parentMap.get(node);
        if (parent != null) {
            dfs(parent, k - 1, parentMap, result);
        }
    }
}

