    public List<List<Integer>> largeGroupPositions(String s) {
        List<List<Integer>> result = new ArrayList<>();
        if (s == null || s.length() == 0) {
            return result;
        }

        int start = 0;
        int end = 0;
        while (end < s.length()) {
            char currentChar = s.charAt(end);
            int nextEnd = end;
            while (nextEnd < s.length() && s.charAt(nextEnd) == currentChar) {
                nextEnd++;
            }

            if (nextEnd - start >= 3) {
                List<Integer> interval = new ArrayList<>();
                interval.add(start);
                interval.add(nextEnd - 1);
                result.add(interval);
            }

            start = nextEnd;
            end = nextEnd;
        }

        return result;
    }
}

