// #Medium #Array #String #Prefix_Sum #2022_08_25_Time_10_ms_(75.00%)_Space_82.7_MB_(75.00%)
public class Solution {
    public String shiftingLetters(String s, int[][] shifts) {
        int n = s.length();
        int[] prefixSum = new int[n + 1];
        for (int[] shift : shifts) {
            int start = shift[0];
            int end = shift[1];
            int direction = shift[2];
            prefixSum[start] += direction;
            if (end + 1 < n) {
                prefixSum[end + 1] -= direction;
            }
        }

        StringBuilder result = new StringBuilder();
        int currentShift = 0;
        for (int i = 0; i < n; i++) {
            currentShift += prefixSum[i];
            int shiftedChar = (s.charAt(i) - 'a' + currentShift) % 26;
            if (shiftedChar < 0) {
                shiftedChar += 26;
            }
            result.append((char) ('a' + shiftedChar));
        }

        return result.toString();
    }
}

