// #Hard #Dynamic_Programming #Memoization #2022_06_26_Time_254_ms_(91.67%)_Space_51.6_MB_(58.33%)
public class Solution {
    private static final int MOD = 1000000007;

    public int distinctSequences(int n) {
        if (n == 0) {
            return 1;
        }

        long[][] dp = new long[n + 1][6];
        for (int i = 0; i < 6; i++) {
            dp[1][i] = 1;
        }

        for (int i = 2; i <= n; i++) {
            for (int j = 0; j < 6; j++) {
                for (int k = 0; k < 6; k++) {
                    if (gcd(j + 1, k + 1) == 1) {
                        boolean valid = true;
                        for (int l = i - 1; l >= 1; l--) {
                            if (dp[l][j] > 0 && Math.abs(i - l) <= 2) {
                                valid = false;
                                break;
                            }
                        }
                        if (valid) {
                            dp[i][j] = (dp[i][j] + dp[i - 1][k]) % MOD;
                        }
                    }
                }
            }
        }

        long total = 0;
        for (int i = 0; i < 6; i++) {
            total = (total + dp[n][i]) % MOD;
        }

        return (int) total;
    }

    private int gcd(int a, int b) {
        if (b == 0) {
            return a;
        }
        return gcd(b, a % b);
    }
}

