// #Medium #Dynamic_Programming #Math #Combinatorics
// #2022_09_19_Time_1_ms_(99.66%)_Space_41.7_MB_(91.83%)
public class Solution {
    public int numberOfWays(int startPos, int endPos, int k) {
        int diff = Math.abs(startPos - endPos);
        if (diff > k) {
            return 0;
        }
        if (k == diff) {
            return 1;
        }

        long[][] dp = new long[k + 1][k + 1];
        dp[0][0] = 1;

        int MOD = 1000000007;

        for (int i = 1; i <= k; i++) {
            for (int j = 0; j <= i; j++) {
                dp[i][j] = (dp[i - 1][j - 1] + dp[i - 1][j + 1]) % MOD;
            }
        }

        if ((k - diff) % 2 != 0) {
            return 0;
        }

        long combinations = 1;
        int stepsRight = (k + diff) / 2;
        int stepsLeft = k - stepsRight;

        for (int i = 0; i < stepsRight; i++) {
            combinations = (combinations * (k - i)) % MOD;
            long inv = power(i + 1, MOD - 2, MOD);
            combinations = (combinations * inv) % MOD;
        }

        return (int) combinations;
    }

    private long power(long base, long exp, int mod) {
        long res = 1;
        base %= mod;
        while (exp > 0) {
            if (exp % 2 == 1) res = (res * base) % mod;
            base = (base * base) % mod;
            exp /= 2;
        }
        return res;
    }
}

