                }

                int andSetBits = 0;
                int tempAnd = andResult;
                while (tempAnd > 0) {
                    andSetBits += (tempAnd & 1);
                    tempAnd >>= 1;
                }

                if (orSetBits + andSetBits >= k) {
                    count++;
                }
            }
        }

