// #2022_08_25_Time_20_ms_(100.00%)_Space_111.7_MB_(100.00%)
import com_github_leetcode.TreeNode;
import java.util.*;

public class Solution {
    public int amountOfTime(TreeNode root, int start) {
        Map<TreeNode, Integer> nodeToParent = new HashMap<>();
        dfs(root, null, nodeToParent);

        TreeNode startNode = findNode(root, start);

        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(startNode);
        Set<TreeNode> visited = new HashSet<>();
        visited.add(startNode);
        int minutes = 0;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                TreeNode node = queue.poll();

                TreeNode left = node.left;
                TreeNode right = node.right;
                TreeNode parent = nodeToParent.get(node);

                if (left != null && !visited.contains(left)) {
                    queue.offer(left);
                    visited.add(left);
                }
                if (right != null && !visited.contains(right)) {
                    queue.offer(right);
                    visited.add(right);
                }
                if (parent != null && !visited.contains(parent)) {
                    queue.offer(parent);
                    visited.add(parent);
                }
            }
            minutes++;
        }

        return minutes - 1;
    }

    private void dfs(TreeNode node, TreeNode parent, Map<TreeNode, Integer> nodeToParent) {
        if (node == null) {
            return;
        }
        nodeToParent.put(node, parent == null ? -1 : parent.val);
        dfs(node.left, node, nodeToParent);
        dfs(node.right, node, nodeToParent);
    }

    private TreeNode findNode(TreeNode root, int start) {
        if (root == null) {
            return null;
        }
        if (root.val == start) {
            return root;
        }
        TreeNode left = findNode(root.left, start);
        if (left != null) {
            return left;
        }
        return findNode(root.right, start);
    }
}

