public class Solution {
    public long countPairs(int n, int[][] edges) {
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        boolean[] visited = new boolean[n];
        List<Integer> components = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                int count = 0;
                dfs(i, adj, visited, count);
                components.add(dfs(i, adj, visited, 0));
            }
        }

        long totalPairs = (long) n * (n - 1) / 2;
        long reachablePairs = 0;
        for (int size : components) {
            reachablePairs += (long) size * (size - 1) / 2;
        }

        return totalPairs - reachablePairs;
    }

    private int dfs(int node, List<List<Integer>> adj, boolean[] visited, int count) {
        visited[node] = true;
        count++;
        for (int neighbor : adj.get(node)) {
            if (!visited[neighbor]) {
                count = dfs(neighbor, adj, visited, count);
            }
        }
        return count;
    }
}

