        Arrays.fill(dist1, -1);
        int[] dist2 = new int[n];
        Arrays.fill(dist2, -1);

        dfs(edges, node1, 0, dist1);
        dfs(edges, node2, 0, dist2);

        int minMaxDist = Integer.MAX_VALUE;
        int closestNode = -1;

        for (int i = 0; i < n; i++) {
            if (dist1[i] != -1 && dist2[i] != -1) {
                int maxDist = Math.max(dist1[i], dist2[i]);
                if (maxDist < minMaxDist) {
                    minMaxDist = maxDist;
                    closestNode = i;
                } else if (maxDist == minMaxDist && i < closestNode) {
                    closestNode = i;
                }
            }
        }

        return closestNode;
    }

    private void dfs(int[] edges, int startNode, int distance, int[] dist) {
        if (dist[startNode] != -1) {
            return;
        }

        dist[startNode] = distance;
        int nextNode = edges[startNode];

        if (nextNode != -1) {
            dfs(edges, nextNode, distance + 1, dist);
        }
    }
}

