public class Solution {
    public boolean matchReplacement(String s, String sub, char[][] mappings) {
        int n = s.length();
        int m = sub.length();

        if (m > n) {
            return false;
        }

        Set<String> possibleSubstrings = new HashSet<>();
        possibleSubstrings.add(sub);

        for (char[] mapping : mappings) {
            char oldChar = mapping[0];
            char newChar = mapping[1];

            Set<String> newPossibleSubstrings = new HashSet<>();
            for (String currentSub : possibleSubstrings) {
                for (int i = 0; i < currentSub.length(); i++) {
                    if (currentSub.charAt(i) == oldChar) {
                        String newSub = currentSub.substring(0, i) + newChar + currentSub.substring(i + 1);
                        newPossibleSubstrings.add(newSub);
                    }
                }
            }
            possibleSubstrings.addAll(newPossibleSubstrings);
        }

        for (String possibleSub : possibleSubstrings) {
            for (int i = 0; i <= n - m; i++) {
                if (s.substring(i, i + m).equals(possibleSub)) {
                    return true;
                }
            }
        }

        return false;
    }
}

