public class Solution {
    public int distributeCookies(int[] c, int k) {
        int n = c.length;
        int[] sums = new int[k];
        return backtrack(c, 0, k, sums, Integer.MAX_VALUE);
    }

    private int backtrack(int[] cookies, int index, int k, int[] sums, int minUnfairness) {
        if (index == cookies.length) {
            int maxChildCookies = 0;
            for (int sum : sums) {
                maxChildCookies = Math.max(maxChildCookies, sum);
            }
            return maxChildCookies;
        }

        for (int i = 0; i < k; i++) {
            sums[i] += cookies[index];
            minUnfairness = Math.min(minUnfairness, backtrack(cookies, index + 1, k, sums, minUnfairness));
            sums[i] -= cookies[index];
        }

        return minUnfairness;
    }
}

