        int m = grid.length;
        int n = grid[0].length;
        long count = 1;
        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        for (int[] dir : directions) {
            int newI = i + dir[0];
            int newJ = j + dir[1];
            if (newI >= 0 && newI < m && newJ >= 0 && newJ < n && grid[newI][newJ] > grid[i][j]) {
                count = (count + dfs(grid, newI, newJ, dp)) % MOD;
            }
        }
        dp[i][j] = (int) count;
        return count;
    }
}

