public class Solution {
    // number n as an array, splitted by each digit
    public int countSpecialNumbers(int n) {
        String s = String.valueOf(n);
        int len = s.length();
        int[][] dp = new int[len + 1][1 << 10];
        for (int i = 0; i <= len; i++) {
            for (int j = 0; j < (1 << 10); j++) {
                dp[i][j] = -1;
            }
        }
        return dfs(0, 0, true, s, dp);
    }

    private int dfs(int pos, int mask, boolean isLimit, String s, int[][] dp) {
        if (pos == s.length()) {
            return 1;
        }
        if (dp[pos][mask] != -1 && !isLimit) {
            return dp[pos][mask];
        }
        int up = isLimit ? s.charAt(pos) - '0' : 9;
        int ans = 0;
        for (int i = 0; i <= up; i++) {
            if ((mask & (1 << i)) == 0) {
                ans += dfs(pos + 1, mask | (1 << i), isLimit && (i == up), s, dp);
            }
        }
        if (!isLimit) {
            dp[pos][mask] = ans;
        }
        return ans;
    }
}

