            counts.put(digit, counts.getOrDefault(digit, 0) + 1);
        }

        StringBuilder left = new StringBuilder();
        int singleDigit = -1;

        for (int i = 9; i >= 0; i--) {
            int count = counts.getOrDefault(i, 0);
            int pairs = count / 2;
            for (int j = 0; j < pairs; j++) {
                left.append(i);
            }
        }

        if (left.length() == 0) {
            for (int i = 9; i >= 0; i--) {
                if (counts.containsKey(i) && counts.get(i) > 0) {
                    return String.valueOf(i);
                }
            }
            return "0";
        }

        if (left.charAt(0) == '0') {
            for (int i = 1; i <= 9; i++) {
                if (counts.containsKey(i) && counts.get(i) > 0) {
                    return String.valueOf(i);
                }
            }
            return "0";
        }

        StringBuilder right = new StringBuilder(left).reverse();

        for (int i = 9; i >= 0; i--) {
            if (counts.containsKey(i) && counts.get(i) % 2 != 0) {
                if (singleDigit == -1) {
                    singleDigit = i;
                }
            }
        }

        if (singleDigit != -1) {
            return left.toString() + singleDigit + right.toString();
        } else {
            return left.toString() + right.toString();
        }
    }
