// #Hard #Depth_First_Search #Graph #Topological_Sort
// #2022_08_14_Time_37_ms_(90.19%)_Space_102.8_MB_(72.92%)
public class Solution {
    public int longestCycle(int[] edges) {
        int n = edges.length;
        int[] visited = new int[n];
        int[] path = new int[n];
        int maxCycle = -1;

        for (int i = 0; i < n; i++) {
            if (visited[i] == 0) {
                int cycleLength = dfs(i, edges, visited, path);
                maxCycle = Math.max(maxCycle, cycleLength);
            }
        }

        return maxCycle;
    }

    private int dfs(int node, int[] edges, int[] visited, int[] path) {
        visited[node] = 1;
        path[node] = 1;

        int nextNode = edges[node];
        if (nextNode != -1) {
            if (visited[nextNode] == 0) {
                int cycleLength = dfs(nextNode, edges, visited, path);
                return cycleLength;
            } else if (path[nextNode] == 1) {
                int cycleLength = 0;
                int current = node;
                while (current != nextNode) {
                    cycleLength++;
                    current = edges[current];
                }
                cycleLength++;
                return cycleLength;
            }
        }

        path[node] = 0;
        return -1;
    }
}

