import java.util.Arrays;

public class Solution {
    public long minSumSquareDiff(int[] nums1, int[] nums2, int k1, int k2) {
        int n = nums1.length;
        long[] diffs = new long[n];
        for (int i = 0; i < n; i++) {
            diffs[i] = Math.abs(nums1[i] - nums2[i]);
        }
        Arrays.sort(diffs);
        long totalK = (long) k1 + k2;
        for (int i = n - 1; i >= 0; i--) {
            if (totalK == 0) {
                break;
            }
            long diff = diffs[i];
            if (diff == 0) {
                break;
            }
            long reduce = Math.min(totalK, diff);
            diffs[i] -= reduce;
            totalK -= reduce;
        }
        long result = 0;
        for (long diff : diffs) {
            result += diff * diff;
        }
        return result;
    }
}

