// #2022_09_14_Time_1_ms_(100.00%)_Space_40.7_MB_(93.95%)
public class Solution {
    public int maximumRows(int[][] matrix, int numSelect) {
        int m = matrix.length;
        int n = matrix[0].length;
        int maxRows = 0;

        for (int i = 0; i < (1 << n); i++) {
            if (Integer.bitCount(i) != numSelect) {
                continue;
            }

            int coveredRows = 0;
            for (int row = 0; row < m; row++) {
                boolean covered = true;
                boolean hasOne = false;
                for (int col = 0; col < n; col++) {
                    if (matrix[row][col] == 1) {
                        hasOne = true;
                        if ((i & (1 << col)) == 0) {
                            covered = false;
                            break;
                        }
                    }
                }
                if (!hasOne) {
                    covered = true;
                }
                if (covered) {
                    coveredRows++;
                }
            }
            maxRows = Math.max(maxRows, coveredRows);
        }

        return maxRows;
    }
}

