        for (int[] item : items1) {
            int value = item[0];
            int weight = item[1];
            valueToWeight.put(value, valueToWeight.getOrDefault(value, 0) + weight);
        }

        for (int[] item : items2) {
            int value = item[0];
            int weight = item[1];
            valueToWeight.put(value, valueToWeight.getOrDefault(value, 0) + weight);
        }

        List<List<Integer>> result = new ArrayList<>();
