// #Hard #Backtracking #2022_06_20_Time_78_ms_(63.64%)_Space_53.1_MB_(63.64%)
public class Solution {
    public long sellingWood(int m, int n, int[][] prices) {
        Map<String, Long> memo = new HashMap<>();
        return solve(m, n, prices, memo);
    }

    private long solve(int height, int width, int[][] prices, Map<String, Long> memo) {
        String key = height + "," + width;
        if (memo.containsKey(key)) {
            return memo.get(key);
        }

        long maxProfit = 0;

        // Check if the current piece can be sold directly
        for (int[] price : prices) {
            if (price[0] == height && price[1] == width) {
                maxProfit = Math.max(maxProfit, price[2]);
            }
        }

        // Try cutting vertically
        for (int i = 1; i < height; i++) {
            maxProfit = Math.max(maxProfit, solve(i, width, prices, memo) + solve(height - i, width, prices, memo));
        }

        // Try cutting horizontally
        for (int i = 1; i < width; i++) {
            maxProfit = Math.max(maxProfit, solve(height, i, prices, memo) + solve(height, width - i, prices, memo));
        }

        memo.put(key, maxProfit);
        return maxProfit;
    }
}

