import java.util.ArrayList;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Queue;

public class Solution {
    public int[][] buildMatrix(int k, int[][] rowC, int[][] colC) {
        List<Integer> rowOrder = topologicalSort(k, rowC);
        List<Integer> colOrder = topologicalSort(k, colC);

        if (rowOrder.size() != k || colOrder.size() != k) {
            return new int[0][0];
        }

        int[][] matrix = new int[k][k];
        Map<Integer, Integer> rowMap = new HashMap<>();
        Map<Integer, Integer> colMap = new HashMap<>();

        for (int i = 0; i < k; i++) {
            rowMap.put(rowOrder.get(i), i);
            colMap.put(colOrder.get(i), i);
        }

        for (int i = 1; i <= k; i++) {
            matrix[rowMap.get(i)][colMap.get(i)] = i;
        }

        return matrix;
    }

    private List<Integer> topologicalSort(int k, int[][] conditions) {
        Map<Integer, List<Integer>> graph = new HashMap<>();
        int[] inDegree = new int[k + 1];

        for (int i = 1; i <= k; i++) {
            graph.put(i, new ArrayList<>());
        }

        for (int[] condition : conditions) {
            int above = condition[0];
            int below = condition[1];
            graph.get(above).add(below);
            inDegree[below]++;
        }

        Queue<Integer> queue = new LinkedList<>();
        for (int i = 1; i <= k; i++) {
            if (inDegree[i] == 0) {
                queue.offer(i);
            }
        }

        List<Integer> result = new ArrayList<>();
        while (!queue.isEmpty()) {
            int node = queue.poll();
            result.add(node);

            for (int neighbor : graph.get(node)) {
                inDegree[neighbor]--;
                if (inDegree[neighbor] == 0) {
                    queue.offer(neighbor);
                }
            }
        }

        return result;
    }
}

