public class Solution {
    public int minimumNumbers(int num, int k) {
        if (num == 0) {
            return 0;
        }
        if (k == 0) {
            return -1;
        }

        int count = 0;
        while (num > 0) {
            int lastDigit = num % 10;
            if (lastDigit < k) {
                count++;
                num -= lastDigit;
            } else if (lastDigit == k) {
                num -= k;
                count++;
            } else {
                if (k == 1) {
                    count += (lastDigit / k);
                    num -= (lastDigit);
                } else {
                    int diff = lastDigit - k;
                    if (diff >= 0) {
                        count += (diff / k) + 1;
                        num -= (diff + k);
                    } else {
                        return -1;
                    }
                }
            }
        }
        return count;
    }
}

