public class Solution {
    public String smallestNumber(String pattern) {
        int n = pattern.length();
        int[] ans = new int[n + 1];
        int start = 1;
        for (int i = 0; i < n; i++) {
            if (pattern.charAt(i) == 'I') {
                ans[i] = start++;
            } else {
                int j = i + 1;
                while (j < n && pattern.charAt(j) == 'D') {
                    j++;
                }
                for (int k = i; k <= j; k++) {
                    ans[k] = start++;
                }
                i = j;
            }
        }
        ans[n] = start;
        StringBuilder sb = new StringBuilder();
        for (int num : ans) {
            sb.append(num);
        }
        return sb.toString();
    }
}

