// #Medium #Dynamic_Programming #2022_06_28_Time_13_ms_(82.46%)_Space_40.6_MB_(94.91%)
public class Solution {
    public int countHousePlacements(int n) {
        long mod = 1000000007;
        long[] dp0 = new long[n + 1];
        long[] dp1 = new long[n + 1];
        dp0[0] = 1;
        dp1[0] = 0;
        for (int i = 1; i <= n; i++) {
            dp0[i] = (dp0[i - 1] + dp1[i - 1]) % mod;
            dp1[i] = dp0[i - 1] % mod;
        }
        long result = (dp0[n] * dp0[n]) % mod;
        return (int) result;
    }
}

