public class Solution {
    public int latestTimeCatchTheBus(int[] buses, int[] passengers, int capacity) {
        Arrays.sort(buses);
        Arrays.sort(passengers);
        int busIndex = 0;
        int passengerIndex = 0;
        int[] busOccupancy = new int[buses.length];
        int latestTime = -1;
        while (passengerIndex < passengers.length) {
            int passengerArrivalTime = passengers[passengerIndex];
            boolean boarded = false;
            for (int i = 0; i < buses.length; i++) {
                if (passengerArrivalTime <= buses[i] && busOccupancy[i] < capacity) {
                    busOccupancy[i]++;
                    latestTime = passengerArrivalTime;
                    boarded = true;
                    break;
                }
            }
            if (!boarded) {
                break;
            }
            passengerIndex++;
        }
        return latestTime;
    }
}

