public class Solution {
    public int countSubarrays(int[] nums, int k) {
        int n = nums.length;
        int count = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i; j < n; j++) {
                int[] subarray = new int[j - i + 1];
                for (int l = i; l <= j; l++) {
                    subarray[l - i] = nums[l];
                }
                if (findMedian(subarray) == k) {
                    count++;
                }
            }
        }
        return count;
    }

    private int findMedian(int[] arr) {
        int[] sortedArr = arr.clone();
        java.util.Arrays.sort(sortedArr);
        int len = sortedArr.length;
        return sortedArr[(len - 1) / 2];
    }
}

