import java.util.Arrays;
public class Solution {
    public int deleteGreatestValue(int[][] grid) {
        int answer = 0;
        int cols = grid[0].length;
        while (cols > 0) {
            int maxDeleted = 0;
            for (int i = 0; i < grid.length; i++) {
                int maxVal = grid[i][0];
                int maxIndex = 0;
                for (int j = 1; j < cols; j++) {
                    if (grid[i][j] > maxVal) {
                        maxVal = grid[i][j];
                        maxIndex = j;
                    }
                }
                maxDeleted = Math.max(maxDeleted, maxVal);

                for (int k = maxIndex; k < cols - 1; k++) {
                    grid[i][k] = grid[i][k + 1];
                }
            }
            answer += maxDeleted;
            cols--;
        }
        return answer;
    }
}

