import java.util.Arrays;

public class Solution {
    public int hardestWorker(int[][] logs) {
        int n = logs.length;
        int[] durations = new int[n];
        for (int i = 0; i < n; i++) {
            durations[i] = logs[i][1];
            if (i > 0) {
                durations[i] -= logs[i - 1][1];
            }
        }

        int maxDuration = 0;
        int hardestWorkerId = -1;

        for (int i = 0; i < n; i++) {
            if (durations[i] > maxDuration) {
                maxDuration = durations[i];
                hardestWorkerId = logs[i][0];
            } else if (durations[i] == maxDuration) {
                hardestWorkerId = Math.min(hardestWorkerId, logs[i][0]);
            }
        }

        return hardestWorkerId;
    }
}

