public class Solution {
    public int longestSubarray(int[] nums) {
        int n = nums.length;
        int maxAnd = 0;
        for (int i = 0; i < n; i++) {
            int currentAnd = nums[i];
            maxAnd = Math.max(maxAnd, currentAnd);
            for (int j = i + 1; j < n; j++) {
                currentAnd &= nums[j];
                maxAnd = Math.max(maxAnd, currentAnd);
            }
        }

        int maxLength = 0;
        for (int i = 0; i < n; i++) {
            int currentAnd = nums[i];
            if (currentAnd == maxAnd) {
                maxLength = Math.max(maxLength, 1);
            }
            for (int j = i + 1; j < n; j++) {
                currentAnd &= nums[j];
                if (currentAnd == maxAnd) {
                    maxLength = Math.max(maxLength, j - i + 1);
                }
            }
        }

        return maxLength;
    }
}

