        Arrays.sort(robots);

        // Sort factories by x-position in ascending order
        Arrays.sort(f, (a, b) -> Integer.compare(a[0], b[0]));

        long totalDistance = 0;
        int[] factoryCapacity = new int[m];
        for (int i = 0; i < m; i++) {
