            long minDistance = Long.MAX_VALUE;

            for (int j = 0; j < m; j++) {
                if (factoryCapacity[j] > 0) {
                    long distance = Math.abs(robots[i] - f[j][0]);
                    if (distance < minDistance) {
                        minDistance = distance;
                        bestFactory = j;
                    }
                }
            }

            if (bestFactory != -1) {
                totalDistance += minDistance;
                factoryCapacity[bestFactory]--;
            } else {
                // If no factory has capacity, find the closest one regardless of capacity
                long minDistanceToAny = Long.MAX_VALUE;
                int closestFactory = -1;
                for (int j = 0; j < m; j++) {
                    long distance = Math.abs(robots[i] - f[j][0]);
                    if (distance < minDistanceToAny) {
