public class Solution {
    public int deleteString(String s) {
        int n = s.length();
        int[] dp = new int[n + 1];
        dp[0] = 0;

        for (int i = 1; i <= n; i++) {
            dp[i] = dp[i - 1] + 1; // Delete the entire string

            for (int j = 1; j <= i / 2; j++) {
                String prefix = s.substring(0, j);
                String suffix = s.substring(j, 2 * j);
