        int bobStartDay = Integer.parseInt(arriveBob.substring(3, 5));
        int bobEndMonth = Integer.parseInt(leaveBob.substring(0, 2));
        int bobEndDay = Integer.parseInt(leaveBob.substring(3, 5));

        int startMonth = Math.max(aliceStartMonth, bobStartMonth);
        int endMonth = Math.min(aliceEndMonth, bobEndMonth);

        int startDay = 0;
        if (aliceStartMonth == bobStartMonth) {
            startDay = Math.max(aliceStartDay, bobStartDay);
        } else if (aliceStartMonth < bobStartMonth) {
            startDay = aliceStartDay;
        } else {
            startDay = bobStartDay;
        }

        int endDay = 0;
        if (aliceEndMonth == bobEndMonth) {
            endDay = Math.min(aliceEndDay, bobEndDay);
        } else if (aliceEndMonth < bobEndMonth) {
            endDay = aliceEndDay;
        } else {
            endDay = bobEndDay;
        }

        if (startMonth > endMonth) {
            return 0;
        }

        int totalDays = 0;
        if (startMonth == endMonth) {
            totalDays = endDay - startDay + 1;
            if (totalDays < 0) {
