            int daysInStartMonth = daysInMonth[startMonth - 1] - startDay + 1;
            int daysInEndMonth = endDay;
            totalDays = daysInStartMonth + daysInEndMonth;

            for (int i = startMonth + 1; i < endMonth; i++) {
                totalDays += daysInMonth[i - 1];
            }
        }

        if (totalDays < 0) {
