import java.util.PriorityQueue;
public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        PriorityQueue<Integer> left = new PriorityQueue<>();
        PriorityQueue<Integer> right = new PriorityQueue<>();
        for (int i = 0; i < candidates; i++) {
            left.add(costs[i]);
        }
        for (int i = costs.length - 1; i >= costs.length - candidates; i--) {
            right.add(costs[i]);
        }
        long totalCost = 0;
        for (int i = 0; i < k; i++) {
            int leftMin = left.isEmpty() ? Integer.MAX_VALUE : left.peek();
            int rightMin = right.isEmpty() ? Integer.MAX_VALUE : right.peek();
            if (leftMin <= rightMin) {
                totalCost += leftMin;
                left.poll();
                if (costs.length > candidates) {
                    left.add(costs[candidates]);
                    candidates++;
                }
            } else {
                totalCost += rightMin;
                right.poll();
                if (costs.length - 1 - (costs.length - candidates - 1) > 0) {
                    right.add(costs[costs.length - 1 - (costs.length - candidates - 1)]);
                    candidates++;
                }
            }
        }
        return totalCost;
    }
}

