public class Solution {
    public List<List<String>> mostPopularCreator(String[] creators, String[] ids, int[] views) {
        Map<String, Integer> creatorPopularity = new HashMap<>();
        Map<String, Integer> creatorMaxViews = new HashMap<>();
        Map<String, String> creatorMostPopularId = new HashMap<>();

        for (int i = 0; i < creators.length; i++) {
            String creator = creators[i];
            String id = ids[i];
            int view = views[i];

            creatorPopularity.put(creator, creatorPopularity.getOrDefault(creator, 0) + view);

            if (!creatorMaxViews.containsKey(creator) || view > creatorMaxViews.get(creator)) {
                creatorMaxViews.put(creator, view);
                creatorMostPopularId.put(creator, id);
            } else if (view == creatorMaxViews.get(creator)) {
                if (id.compareTo(creatorMostPopularId.get(creator)) < 0) {
                    creatorMostPopularId.put(creator, id);
                }
            }
        }

        int maxPopularity = 0;
        for (int popularity : creatorPopularity.values()) {
            maxPopularity = Math.max(maxPopularity, popularity);
        }

        List<List<String>> result = new ArrayList<>();
        for (Map.Entry<String, Integer> entry : creatorPopularity.entrySet()) {
            if (entry.getValue() == maxPopularity) {
                List<String> creatorInfo = new ArrayList<>();
                creatorInfo.add(entry.getKey());
                creatorInfo.add(creatorMostPopularId.get(entry.getKey()));
                result.add(creatorInfo);
            }
        }

        return result;
    }
