import java.util.List;

public class Solution {
    public long minimumFuelCost(int[][] roads, int seats) {
        int n = roads.length + 1;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] road : roads) {
            int u = road[0];
            int v = road[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        long[] fuel = new long[n];
        dfs(0, -1, adj, fuel, seats);
        long totalFuel = 0;
        for (long f : fuel) {
            totalFuel += f;
        }
        return totalFuel;
    }

    private long dfs(int u, int parent, List<List<Integer>> adj, long[] fuel, int seats) {
        long people = 1;
        for (int v : adj.get(u)) {
            if (v != parent) {
                people += dfs(v, u, adj, fuel, seats);
            }
        }
        fuel[u] = (people + seats - 1) / seats;
        return fuel[u];
    }
}

