import java.util.PriorityQueue;

public class Solution {
    public int maxStarSum(int[] nodeValues, int[][] edges, int maxNumberOfEdges) {
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < nodeValues.length; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> nodeValues[b] - nodeValues[a]);
        for (int i = 0; i < nodeValues.length; i++) {
            pq.offer(i);
        }

        int maxStarSum = 0;
        while (!pq.isEmpty() && maxNumberOfEdges > 0) {
            int center = pq.poll();
            int currentStarSum = nodeValues[center];
            List<Integer> neighbors = adj.get(center);
            neighbors.sort((a, b) -> nodeValues[b] - nodeValues[a]);

            int edgesUsed = 0;
            for (int neighbor : neighbors) {
                if (edgesUsed < maxNumberOfEdges) {
                    currentStarSum += nodeValues[neighbor];
                    edgesUsed++;
                } else {
                    break;
                }
            }
            maxStarSum = Math.max(maxStarSum, currentStarSum);
        }

        return maxStarSum;
    }
}

