public class Solution {
    public int maxJump(int[] stones) {
        int n = stones.length;
        int minCost = Integer.MAX_VALUE;

        for (int i = 0; i < (1 << (n - 1)); i++) {
            int currentCost = 0;
            int currentPosition = stones[0];
            int lastJump = 0;

            for (int j = 0; j < n - 1; j++) {
                if ((i & (1 << j)) != 0) {
                    int jump = Math.abs(stones[j + 1] - currentPosition);
                    currentCost = Math.max(currentCost, jump);
                    currentPosition = stones[j + 1];
                    lastJump = jump;
                }
            }

            int returnJump = Math.abs(stones[n - 1] - stones[0]);
            currentCost = Math.max(currentCost, returnJump);

            minCost = Math.min(minCost, currentCost);
        }

        return minCost;
    }
}

