import java.util.ArrayList;
import java.util.List;
public class Solution {
    public List<Integer> goodIndices(int[] nums, int k) {
        int n = nums.length;
        List<Integer> goodIndices = new ArrayList<>();
        if (n < 2 * k + 1) {
            return goodIndices;
        }

        int[] left = new int[n];
        int current = 0;
        for (int i = 0; i < n; i++) {
            if (i == 0 || nums[i] <= nums[i - 1]) {
                current = 1;
            } else {
                current++;
            }
            left[i] = current;
        }

        int[] right = new int[n];
        current = 0;
        for (int i = n - 1; i >= 0; i--) {
            if (i == n - 1 || nums[i] >= nums[i + 1]) {
                current = 1;
            } else {
                current++;
            }
            right[i] = current;
        }

        for (int i = k; i < n - k; i++) {
            if (left[i] >= k + 1 && right[i] >= k + 1) {
                goodIndices.add(i);
            }
        }

        return goodIndices;
    }
}

