public class Solution {
    public int mostProfitablePath(int[][] edges, int bob, int[] amount) {
        int n = amount.length;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int maxProfit = Integer.MIN_VALUE;
        for (int leaf : getLeaves(adj)) {
            int profit = dfs(0, leaf, bob, amount, adj, new boolean[n]);
            maxProfit = Math.max(maxProfit, profit);
        }

        return maxProfit;
    }

    private List<Integer> getLeaves(List<List<Integer>> adj) {
        List<Integer> leaves = new ArrayList<>();
        for (int i = 0; i < adj.size(); i++) {
            if (adj.get(i).size() == 1) {
                leaves.add(i);
            }
        }
        return leaves;
    }

    private int dfs(int u, int target, int bob, int[] amount, List<List<Integer>> adj, boolean[] visited) {
        visited[u] = true;
        int profit = amount[u];

        if (u == target) {
            visited[u] = false;
            return profit;
        }

        int maxProfit = Integer.MIN_VALUE;
        for (int v : adj.get(u)) {
            if (!visited[v]) {
                int currentProfit = dfs(v, target, bob, amount, adj, new boolean[amount.length]);
                if (currentProfit != Integer.MIN_VALUE) {
                    maxProfit = Math.max(maxProfit, currentProfit);
                }
            }
        }

        visited[u] = false;
        if (maxProfit == Integer.MIN_VALUE) {
            return Integer.MIN_VALUE;
        }
        return profit + maxProfit;
    }
}

