public class Solution {
    public int componentValue(int[] nums, int[][] edges) {
        int n = nums.length;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int totalSum = 0;
        for (int num : nums) {
            totalSum += num;
        }

        int maxDeletedEdges = -1;
        for (int i = 0; i < (1 << edges.length); i++) {
            List<int[]> remainingEdges = new ArrayList<>();
            int deletedEdges = 0;
            for (int j = 0; j < edges.length; j++) {
                if ((i & (1 << j)) == 0) {
                    remainingEdges.add(edges[j]);
                } else {
                    deletedEdges++;
                }
            }

            List<List<Integer>> components = new ArrayList<>();
            boolean[] visited = new boolean[n];
            for (int j = 0; j < n; j++) {
                if (!visited[j]) {
                    List<Integer> component = new ArrayList<>();
                    dfs(j, adj, visited, remainingEdges, component);
                    components.add(component);
                }
            }

            boolean valid = true;
            int componentValue = -1;
            for (List<Integer> component : components) {
                int sum = 0;
                for (int node : component) {
                    sum += nums[node];
                }
                if (componentValue == -1) {
                    componentValue = sum;
                } else if (componentValue != sum) {
                    valid = false;
                    break;
                }
            }

            if (valid) {
                maxDeletedEdges = Math.max(maxDeletedEdges, deletedEdges);
            }
        }

        return maxDeletedEdges;
    }

    private void dfs(int node, List<List<Integer>> adj, boolean[] visited, List<int[]> remainingEdges, List<Integer> component) {
        visited[node] = true;
        component.add(node);

        for (int neighbor : adj.get(node)) {
            boolean connected = false;
            for (int[] edge : remainingEdges) {
                if ((edge[0] == node && edge[1] == neighbor) || (edge[0] == neighbor && edge[1] == node)) {
                    connected = true;
                    break;
                }
            }
            if (connected && !visited[neighbor]) {
                dfs(neighbor, adj, visited, remainingEdges, component);
            }
        }
    }
}

