        pow10 /= 10;

        while (sum > target && pow10 > 0) {
            int digit = (int) (n / pow10) % 10;
            int diff = sum - target;
            if (digit >= diff) {
                x += (long) (digit - diff) * pow10;
                sum -= diff;
            } else {
                x += (long) (10 - diff) * pow10;
                sum -= (10 - digit);
            }
            if (sum <= target) {
                break;
            }
            pow10 /= 10;
        }

        if (sum > target) {
            x += (long) (sum - target);
        }

        return x;
    }
}

