public class Solution {
    public int numberOfGoodPaths(int[] vals, int[][] edges) {
        int n = vals.length;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int count = 0;
        for (int i = 0; i < n; i++) {
            count++; // Single node is a valid path
            for (int j = i + 1; j < n; j++) {
                if (vals[i] == vals[j] && isValidPath(i, j, vals, adj)) {
                    count++;
                }
            }
        }

        return count;
    }

    private boolean isValidPath(int start, int end, int[] vals, List<List<Integer>> adj) {
        int maxValue = vals[start];
        boolean[] visited = new boolean[vals.length];
        return dfs(start, end, vals, adj, visited, maxValue);
    }

    private boolean dfs(int u, int end, int[] vals, List<List<Integer>> adj, boolean[] visited, int maxValue) {
        if (u == end) {
            return true;
        }

        visited[u] = true;

        for (int v : adj.get(u)) {
            if (!visited[v] && vals[v] <= maxValue) {
                if (dfs(v, end, vals, adj, visited, maxValue)) {
                    return true;
                }
            }
        }

        return false;
    }
}

