        for (int i = 0; i <= n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int[] colors = new int[n + 1];
        Arrays.fill(colors, 0);

        int maxGroups = 0;
        for (int startNode = 1; startNode <= n; startNode++) {
            if (colors[startNode] == 0) {
                int groups = 0;
                Queue<Integer> q = new LinkedList<>();
                q.offer(startNode);
                colors[startNode] = 1;
                groups++;

                while (!q.isEmpty()) {
                    int u = q.poll();
                    for (int v : adj.get(u)) {
                        if (colors[v] == 0) {
                            if (Math.abs(colors[u] - 1) == 0) {
                                colors[v] = 2;
                                q.offer(v);
                                groups++;
                            } else if (Math.abs(colors[u] - 2) == 0) {
                                colors[v] = 1;
                                q.offer(v);
                                groups++;
                            }
                        } else if (colors[v] == colors[u]) {
                            return -1;
                        }
                    }
                }
                maxGroups = Math.max(maxGroups, groups);
