                availableRooms.offer(room[0]);
            }
            int roomNumber = availableRooms.isEmpty() ? busyRooms.size() : availableRooms.poll();
            if (roomNumber == busyRooms.size()) {
                roomNumber = availableRooms.isEmpty() ? busyRooms.size() : availableRooms.poll();
            }
            roomCounts[roomNumber]++;
            busyRooms.offer(new int[]{roomNumber, end});
        }
        int maxMeetings = 0;
        int mostBookedRoom = 0;
        for (int i = 0; i < n; i++) {
            if (roomCounts[i] > maxMeetings) {
