        int minVal = Integer.MAX_VALUE;
        for (int num : nums) {
            if (num % 2 == 0) {
                pq.offer(num);
                minVal = Math.min(minVal, num);
            } else {
                pq.offer(num * 2);
                minVal = Math.min(minVal, num * 2);
            }
        }

        int deviation = pq.peek() - minVal;

        while (pq.peek() % 2 == 0) {
            int top = pq.poll();
            minVal = Math.min(minVal, top / 2);
            pq.offer(top / 2);
            deviation = Math.min(deviation, pq.peek() - minVal);
        }

        return deviation;
    }
}

