public class Solution {
    public int boxDelivering(int[][] boxes, int portsCount, int maxBoxes, int maxWeight) {
        int n = boxes.length;
        List<Integer> ports = new ArrayList<>();
        List<Integer> weights = new ArrayList<>();
        for (int[] box : boxes) {
            ports.add(box[0]);
            weights.add(box[1]);
        }

        int trips = 0;
        int currentBoxes = 0;
        int currentWeight = 0;
        int currentPort = -1;

        for (int i = 0; i < n; i++) {
            if (currentBoxes == maxBoxes || currentWeight + weights.get(i) > maxWeight) {
                trips++;
                currentBoxes = 0;
                currentWeight = 0;
                currentPort = -1;
            }

            currentBoxes++;
            currentWeight += weights.get(i);

            if (currentPort == -1) {
                currentPort = ports.get(i);
            }

            if (ports.get(i) != currentPort) {
                trips++;
                currentBoxes = 1;
                currentWeight = weights.get(i);
                currentPort = ports.get(i);
            }
        }

        if (currentBoxes > 0) {
            trips++;
        }

        return trips;
    }
}

