public class Solution {
    public int minIncompatibility(int[] nums, int k) {
        int n = nums.length;
        if (n % k != 0) {
            return -1;
        }
        int subsetSize = n / k;
        Arrays.sort(nums);
        int[][] dp = new int[1 << n][k + 1];
        for (int i = 0; i < (1 << n); i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = 0;
        for (int mask = 0; mask < (1 << n); mask++) {
            for (int i = 0; i <= k; i++) {
                if (dp[mask][i] == Integer.MAX_VALUE) {
                    continue;
                }
                if (i == k) {
                    continue;
                }
                for (int submask = 0; submask < (1 << n); submask++) {
                    if ((mask & submask) != 0) {
                        continue;
                    }
                    int subsetSizeCount = 0;
                    int minVal = Integer.MAX_VALUE;
                    int maxVal = Integer.MIN_VALUE;
                    boolean valid = true;
                    for (int j = 0; j < n; j++) {
                        if ((submask & (1 << j)) != 0) {
                            subsetSizeCount++;
                            minVal = Math.min(minVal, nums[j]);
                            maxVal = Math.max(maxVal, nums[j]);
                        }
                    }
                    if (subsetSizeCount != subsetSize) {
                        continue;
                    }
                    boolean hasDuplicates = false;
                    boolean[] seen = new boolean[101];
                    for (int j = 0; j < n; j++) {
                        if ((submask & (1 << j)) != 0) {
                            if (seen[nums[j]]) {
                                hasDuplicates = true;
                                break;
                            }
                            seen[nums[j]] = true;
                        }
                    }
                    if (hasDuplicates) {
                        continue;
                    }
                    int incompatibility = maxVal - minVal;
                    dp[mask | submask][i + 1] = Math.min(dp[mask | submask][i + 1], dp[mask][i] + incompatibility);
                }
            }
        }
        int result = dp[(1 << n) - 1][k];
        return result == Integer.MAX_VALUE ? -1 : result;
    }
}

