// #Hard #Array #Dynamic_Programming #Math #Combinatorics
// #2022_04_21_Time_1_ms_(100.00%)_Space_43.3_MB_(20.97%)
public class Solution {
    public String kthSmallestPath(int[] destination, int k) {
        int horizontal = destination[0];
        int vertical = destination[1];
        StringBuilder result = new StringBuilder();
        while (horizontal > 0 || vertical > 0) {
            long combinations = 0;
            if (horizontal > 0) {
                combinations = combinations(horizontal + vertical - 1, horizontal - 1);
            }
            if (k <= combinations && horizontal > 0) {
                result.append('H');
                horizontal--;
            } else {
                result.append('V');
                vertical--;
                if (horizontal > 0) {
                    k -= combinations;
                }
            }
        }
        return result.toString();
    }

    private long combinations(int n, int k) {
        if (k < 0 || k > n) {
            return 0;
        }
        if (k == 0 || k == n) {
            return 1;
        }
        if (k > n / 2) {
            k = n - k;
        }
        long result = 1;
        for (int i = 1; i <= k; ++i) {
            result = result * (n - i + 1) / i;
        }
        return result;
    }
}

