import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
public class Solution {
    public int[] countSubgraphsForEachDiameter(int n, int[][] edges) {
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0] - 1;
            int v = edge[1] - 1;
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int[] result = new int[n - 1];
        for (int i = 0; i < (1 << n); i++) {
            List<Integer> subgraphNodes = new ArrayList<>();
            for (int j = 0; j < n; j++) {
                if ((i >> j) % 2 == 1) {
                    subgraphNodes.add(j);
                }
            }

            if (subgraphNodes.isEmpty()) {
                continue;
            }

            boolean isSubtree = true;
            for (int u : subgraphNodes) {
                for (int v : subgraphNodes) {
                    if (u != v) {
                        if (!isConnected(u, v, subgraphNodes, adj)) {
                            isSubtree = false;
                            break;
                        }
                    }
                }
                if (!isSubtree) {
                    break;
                }
            }

            if (isSubtree) {
                int maxDistance = 0;
                for (int u : subgraphNodes) {
                    for (int v : subgraphNodes) {
                        maxDistance = Math.max(maxDistance, bfs(u, v, subgraphNodes, adj));
                    }
                }
                if (maxDistance <= n - 1 && maxDistance > 0) {
                    result[maxDistance - 1]++;
                }
            }
        }

        return result;
    }

    private boolean isConnected(int start, int end, List<Integer> subgraphNodes, List<List<Integer>> adj) {
        boolean[] visited = new boolean[adj.size()];
        List<Integer> queue = new ArrayList<>();
        queue.add(start);
        visited[start] = true;

        while (!queue.isEmpty()) {
            int u = queue.remove(0);
            if (u == end) {
                return true;
            }
            for (int v : adj.get(u)) {
                if (subgraphNodes.contains(v) && !visited[v]) {
                    visited[v] = true;
                    queue.add(v);
                }
            }
        }
        return false;
    }

    private int bfs(int start, int end, List<Integer> subgraphNodes, List<List<Integer>> adj) {
        int[] dist = new int[adj.size()];
        for (int i = 0; i < adj.size(); i++) {
            dist[i] = -1;
        }
        dist[start] = 0;
        List<Integer> queue = new ArrayList<>();
        queue.add(start);

        while (!queue.isEmpty()) {
            int u = queue.remove(0);
            for (int v : adj.get(u)) {
                if (subgraphNodes.contains(v) && dist[v] == -1) {
                    dist[v] = dist[u] + 1;
                    queue.add(v);
                }
            }
        }
        return dist[end];
    }
}

