        int m = target.length();
        int[][] dp = new int[m + 1][n + 1];
        dp[0][0] = 1;

        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                if (words[j - 1].charAt(i - 1) == target.charAt(i - 1)) {
                    int used = 0;
                    for (int k = 0; k < j; k++) {
                        if (words[k].charAt(i - 1) == target.charAt(i - 1)) {
                            used++;
                        }
                    }
                    dp[i][j] = (dp[i][j - 1] + dp[i - 1][j - 1]) % MOD;
                } else {
                    dp[i][j] = dp[i][j - 1];
                }
            }
        }

        int result = 0;
        for (int i = 1; i <= n; i++) {
            result = (result + dp[m][i]) % MOD;
        }

        return result;
    }
}

