import java.util.HashSet;
import java.util.LinkedList;
import java.util.Queue;
import java.util.Set;

public class Solution {
    public String solve(String s, int a, int b) {
        int n = s.length();
        Set<String> visited = new HashSet<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer(s);
        visited.add(s);
        String smallest = s;

        while (!queue.isEmpty()) {
            String current = queue.poll();

            if (current.compareTo(smallest) < 0) {
                smallest = current;
            }

            // Apply operation 1: Add a to all odd indices
            String next1 = "";
            for (int i = 0; i < n; i++) {
                int digit = current.charAt(i) - '0';
                if (i % 2 != 0) {
                    digit = (digit + a) % 10;
                }
                next1 += digit;
            }
            if (!visited.contains(next1)) {
                visited.add(next1);
                queue.offer(next1);
            }

            // Apply operation 2: Rotate s to the right by b positions
            String next2 = current.substring(n - b) + current.substring(0, n - b);
            if (!visited.contains(next2)) {
                visited.add(next2);
                queue.offer(next2);
            }
        }

        return smallest;
    }
}

