public class Solution {
    public int visiblePoints(List<List<Integer>> points, int angle, List<Integer> location) {
        List<Double> angles = new ArrayList<>();
        int sameLocation = 0;
        for (List<Integer> point : points) {
            if (point.get(0) == location.get(0) && point.get(1) == location.get(1)) {
                sameLocation++;
            } else {
                double dx = point.get(0) - location.get(0);
                double dy = point.get(1) - location.get(1);
                double angleRad = Math.atan2(dy, dx);
                double angleDeg = Math.toDegrees(angleRad);
                angles.add(angleDeg);
            }
        }
        Collections.sort(angles);
        List<Double> extendedAngles = new ArrayList<>(angles);
        for (double angleDeg : angles) {
            extendedAngles.add(angleDeg + 360);
        }
        int maxVisible = 0;
        int left = 0;
        for (int right = 0; right < extendedAngles.size(); right++) {
            while (extendedAngles.get(right) - extendedAngles.get(left) > angle) {
                left++;
            }
            maxVisible = Math.max(maxVisible, right - left + 1);
        }
        return maxVisible + sameLocation;
    }
}

