public class Solution {

    static class Pair {
        int pos;
        boolean jumpedBack;

        public Pair(int pos, boolean jumpedBack) {
            this.pos = pos;
            this.jumpedBack = jumpedBack;
        }
    }

    public int minJump(int[] forbidden, int a, int b, int x) {
        Set<Integer> forbiddenSet = new HashSet<>();
        for (int num : forbidden) {
            forbiddenSet.add(num);
        }

        Queue<Pair> queue = new LinkedList<>();
        queue.offer(new Pair(0, false));

        Set<String> visited = new HashSet<>();
        visited.add("0_false");

        int steps = 0;
        int maxReach = 2000 + b;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                Pair curr = queue.poll();
                int pos = curr.pos;
                boolean jumpedBack = curr.jumpedBack;

                if (pos == x) {
                    return steps;
                }

                // Jump forward
                int nextPosForward = pos + a;
                if (nextPosForward <= maxReach && !forbiddenSet.contains(nextPosForward) && !visited.contains(nextPosForward + "_false")) {
                    queue.offer(new Pair(nextPosForward, false));
                    visited.add(nextPosForward + "_false");
                }

                // Jump backward
                int nextPosBackward = pos - b;
                if (nextPosBackward >= 0 && !forbiddenSet.contains(nextPosBackward) && !jumpedBack && !visited.contains(nextPosBackward + "_true")) {
                    queue.offer(new Pair(nextPosBackward, true));
                    visited.add(nextPosBackward + "_true");
                }
            }
            steps++;
        }

        return -1;
    }
}

