                if (!foundAlternative) {
                    unableToEat++;
                    studentQueue.poll();
                }
            }
            if (sandwichIndex == sandwiches.length && !studentQueue.isEmpty()) {
                unableToEat += studentQueue.size();
                break;
            }
        }

        return unableToEat;
    }
