public class Solution {
    public int minimumMountainRemovals(int[] nums) {
        int n = nums.length;
        List<Integer> lis = new ArrayList<>();
        List<Integer> lds = new ArrayList<>();
        int[] dp1 = new int[n];
        int[] dp2 = new int[n];

        for (int i = 0; i < n; i++) {
            int num = nums[i];
            int index = Collections.binarySearch(lis, num);
            if (index < 0) {
                index = -index - 1;
            }
            if (index == lis.size()) {
                lis.add(num);
            } else {
                lis.set(index, num);
            }
            dp1[i] = index + 1;
        }

        for (int i = n - 1; i >= 0; i--) {
            int num = nums[i];
            int index = Collections.binarySearch(lds, num);
            if (index < 0) {
                index = -index - 1;
            }
            if (index == lds.size()) {
                lds.add(num);
            } else {
                lds.set(index, num);
            }
            dp2[i] = index + 1;
        }

        int maxLen = 0;
        for (int i = 0; i < n; i++) {
            if (dp1[i] > 1 && dp2[i] > 1) {
                maxLen = Math.max(maxLen, dp1[i] + dp2[i] - 1);
            }
        }

        return n - maxLen;
    }
