import java.util.List;
import java.util.PriorityQueue;
import java.util.TreeSet;

public class Solution {

    static class Server {
        int id;
        int busyTime;

        public Server(int id, int busyTime) {
            this.id = id;
            this.busyTime = busyTime;
        }
    }

    public List<Integer> busiestServers(int[] arrival, int[] load) {
        int k = load.length;
        int[] requestCount = new int[k];
        int currentTime = 0;
        PriorityQueue<Server> availableServers = new PriorityQueue<>(Comparator.comparingInt(s -> s.id));

        for (int i = 0; i < k; i++) {
            availableServers.offer(new Server(i, 0));
        }

        for (int i = 0; i < arrival.length; i++) {
            currentTime = Math.max(currentTime, arrival[i]);

            Server server = availableServers.poll();
            requestCount[server.id]++;

            int finishTime = currentTime + load[i];
            availableServers.offer(new Server(server.id, finishTime));

            while (!availableServers.isEmpty() && availableServers.peek().busyTime <= currentTime) {
                availableServers.poll();
            }
        }

        int maxRequests = 0;
        for (int count : requestCount) {
            maxRequests = Math.max(maxRequests, count);
        }

        List<Integer> busiestServers = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            if (requestCount[i] == maxRequests) {
                busiestServers.add(i);
            }
        }

        return busiestServers;
    }
}

