import java.util.PriorityQueue;
public class Solution {
    /**
     * Determines the result of the game between Alice and Bob.
     *
     * @param aliceValues An array of integers representing Alice's values for each stone.
     * @param bobValues   An array of integers representing Bob's values for each stone.
     * @return 1 if Alice wins, -1 if Bob wins, and 0 if the game results in a draw.
     */
    public int stoneGame(int[] aliceValues, int[] bobValues) {
        int n = aliceValues.length;
        int aliceScore = 0;
        int bobScore = 0;

        // Create a priority queue to store the differences between Alice and Bob's values for each stone.
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        for (int i = 0; i < n; i++) {
            pq.offer(aliceValues[i] - bobValues[i]);
        }

        // Simulate the game, with Alice and Bob taking turns.
        boolean aliceTurn = true;
        while (!pq.isEmpty()) {
            int diff = pq.poll();
            if (aliceTurn) {
                aliceScore += Math.max(0, diff);
            } else {
                bobScore += Math.max(0, -diff);
            }
            aliceTurn = !aliceTurn;
        }

        // Determine the winner based on the scores.
        if (aliceScore > bobScore) {
            return 1;
        } else if (bobScore > aliceScore) {
            return -1;
        } else {
            return 0;
        }
    }
}

