import java.util.Arrays;
import java.util.List;
import java.util.ArrayList;

public class Solution {

    public boolean[] solve(int n, int[][] edgeList, int[][] queries) {
        boolean[] answer = new boolean[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int p = queries[i][0];
            int q = queries[i][1];
            int limit = queries[i][2];
            answer[i] = hasPath(n, edgeList, p, q, limit);
        }
        return answer;
    }

    private boolean hasPath(int n, int[][] edgeList, int start, int end, int limit) {
        List<List<int[]>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edgeList) {
            int u = edge[0];
            int v = edge[1];
            int dis = edge[2];
            if (dis < limit) {
                adj.get(u).add(new int[]{v, dis});
                adj.get(v).add(new int[]{u, dis});
            }
        }

        boolean[] visited = new boolean[n];
        return dfs(adj, start, end, visited);
    }

    private boolean dfs(List<List<int[]>> adj, int u, int end, boolean[] visited) {
        if (u == end) {
            return true;
        }
        visited[u] = true;
        for (int[] neighbor : adj.get(u)) {
            int v = neighbor[0];
            if (!visited[v]) {
                if (dfs(adj, v, end, visited)) {
                    return true;
                }
            }
        }
        return false;
    }
}

