public class Solution {
    public int maximumRequests(int n, int[][] requests) {
        int maxRequests = 0;
        int[] balance = new int[n];

        for (int i = 0; i < (1 << requests.length); i++) {
            int currentRequests = 0;
            int[] currentBalance = new int[n];

            for (int j = 0; j < requests.length; j++) {
                if ((i >> j) % 2 == 1) {
                    currentRequests++;
                    currentBalance[requests[j][0]]--;
                    currentBalance[requests[j][1]]++;
                }
            }

            boolean possible = true;
            for (int bal : currentBalance) {
                if (bal != 0) {
                    possible = false;
                    break;
                }
            }

            if (possible) {
                maxRequests = Math.max(maxRequests, currentRequests);
            }
        }

        return maxRequests;
    }
}

