import java.util.Arrays;
public class Solution {
    public int maxProfit(int[] inventory, int orders) {
        Arrays.sort(inventory);
        long profit = 0;
        int n = inventory.length;
        int i = n - 1;
        while (orders > 0) {
            int next = (i > 0) ? inventory[i - 1] : 0;
            int diff = inventory[i] - next;
            int count = Math.min(orders, diff * (i + 1));
            int numPairs = count / (i + 1);
            int remainder = count % (i + 1);
            long currentProfit = (long) (inventory[i] + inventory[i] - numPairs + 1) * numPairs / 2 * (i + 1);
            currentProfit += (long) (inventory[i] - numPairs) * remainder;
            profit = (profit + currentProfit) % 1000000007;
            orders -= count;
            if (orders > 0 && i == 0) {
                profit = (profit + (long) orders * inventory[0]) % 1000000007;
                orders = 0;
            }
            if (inventory[i] - numPairs <= next) {
                i--;
            }
        }
        return (int) profit;
    }
}

