import java.util.HashMap;
import java.util.HashSet;
public class Solution {
    // count the characters of every sticker
    // For each character, save the sticker index which has this character
    public int minStickers(String[] stickers, String target) {
        int n = stickers.length;
        int targetLen = target.length();
        int[] dp = new int[1 << targetLen];
        for (int i = 0; i < (1 << targetLen); i++) {
            dp[i] = n + 1;
        }
        dp[0] = 0;

        for (int mask = 0; mask < (1 << targetLen); mask++) {
            if (dp[mask] == n + 1) continue;

            for (int i = 0; i < n; i++) {
                String sticker = stickers[i];
                int nextMask = mask;
                for (char c : sticker.toCharArray()) {
                    for (int j = 0; j < targetLen; j++) {
                        if (target.charAt(j) == c && (mask & (1 << j)) == 0) {
                            nextMask |= (1 << j);
                        }
                    }
                }
                dp[nextMask] = Math.min(dp[nextMask], dp[mask] + 1);
            }
        }

        return dp[(1 << targetLen) - 1] > n ? -1 : dp[(1 << targetLen) - 1];
    }
}

