import java.util.Arrays;

public class Solution {
    public int[] maxSumOfThreeSubarrays(int[] nums, int k) {
        int n = nums.length;
        int[] sum = new int[n - k + 1];
        int currentSum = 0;
        for (int i = 0; i < n; i++) {
            currentSum += nums[i];
            if (i >= k - 1) {
                sum[i - k + 1] = currentSum;
                currentSum -= nums[i - k + 1];
            }
        }

        int[] left = new int[n - k + 1];
        int best = 0;
        for (int i = 0; i < n - k + 1; i++) {
            if (sum[i] > sum[best]) {
                best = i;
            }
            left[i] = best;
        }

        int[] right = new int[n - k + 1];
        best = n - k;
        for (int i = n - k; i >= 0; i--) {
            if (sum[i] >= sum[best]) {
                best = i;
            }
            right[i] = best;
        }

        int[] result = new int[3];
        int maxSum = 0;
        for (int j = k; j <= n - 2 * k; j++) {
            int i = left[j - k];
            int l = right[j + k];
            int currentSum = sum[i] + sum[j] + sum[l];
            if (currentSum > maxSum) {
                maxSum = currentSum;
                result[0] = i;
                result[1] = j;
                result[2] = l;
            }
        }

        return result;
    }
}

