import java.util.LinkedList;
import java.util.List;
import java.util.Objects;
import java.util.PriorityQueue;
import java.util.Queue;

public class Solution {
    public int cutOffTree(List<List<Integer>> forest) {
        PriorityQueue<int[]> trees = new PriorityQueue<>((a, b) -> forest.get(a[0]).get(a[1]) - forest.get(b[0]).get(b[1]));
        int m = forest.size();
        int n = forest.get(0).size();

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (forest.get(i).get(j) > 1) {
                    trees.offer(new int[]{i, j});
                }
            }
        }

        int row = 0;
        int col = 0;
        int steps = 0;

        while (!trees.isEmpty()) {
            int[] tree = trees.poll();
            int targetRow = tree[0];
            int targetCol = tree[1];

            int dist = bfs(forest, row, col, targetRow, targetCol);
            if (dist == -1) {
                return -1;
            }
            steps += dist;
            row = targetRow;
            col = targetCol;
            forest.get(row).set(col, 1);
        }

        return steps;
    }

    private int bfs(List<List<Integer>> forest, int startRow, int startCol, int targetRow, int targetCol) {
        int m = forest.size();
        int n = forest.get(0).size();
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{startRow, startCol, 0});
        boolean[][] visited = new boolean[m][n];
        visited[startRow][startCol] = true;

        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

        while (!queue.isEmpty()) {
            int[] current = queue.poll();
            int row = current[0];
            int col = current[1];
            int dist = current[2];

            if (row == targetRow && col == targetCol) {
                return dist;
            }

            for (int[] dir : directions) {
                int newRow = row + dir[0];
                int newCol = col + dir[1];

                if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n &&
                        forest.get(newRow).get(newCol) > 0 && !visited[newRow][newCol]) {
                    queue.offer(new int[]{newRow, newCol, dist + 1});
                    visited[newRow][newCol] = true;
                }
            }
        }

        return -1;
    }
}

