// #Hard #String #Dynamic_Programming #2022_03_21_Time_22_ms_(93.12%)_Space_59.1_MB_(71.99%)
public class Solution {
    public int numDecodings(String s) {
        int n = s.length();
        long[] dp = new long[n + 1];
        dp[0] = 1;
        dp[1] = s.charAt(0) == '*' ? 9 : (s.charAt(0) == '0' ? 0 : 1);

        for (int i = 2; i <= n; i++) {
            char first = s.charAt(i - 1);
            char second = s.charAt(i - 2);

            if (first == '*') {
                dp[i] = (dp[i - 1] * 9) % 1000000007;
                if (second == '1' || second == '2') {
                    dp[i] = (dp[i] + dp[i - 2]) % 1000000007;
                } else if (second == '*') {
                    dp[i] = (dp[i] + dp[i - 2] * 9) % 1000000007;
                }
            } else {
                if (first != '0') {
                    dp[i] = dp[i - 1];
                }
                int twoDigit = Integer.parseInt(String.valueOf(second) + String.valueOf(first));
                if (twoDigit >= 10 && twoDigit <= 26) {
                    dp[i] = (dp[i] + dp[i - 2]) % 1000000007;
                }
            }
        }

        return (int) dp[n];
    }
}

