import java.util.Arrays;
public class Solution {
    public boolean judgePoint24(int[] cards) {
        if (cards == null || cards.length != 4) {
            return false;
        }
        return solve(cards, 0, new double[4]);
    }

    private boolean solve(int[] cards, int index, double[] nums) {
        if (index == 3) {
            return Math.abs(nums[0] - 24) < 1e-6;
        }

        for (int i = 0; i < 4; i++) {
            if (cards[i] == Integer.MAX_VALUE) continue;

            int card = cards[i];
            cards[i] = Integer.MAX_VALUE;

            if (index == 0) {
                nums[0] = (double) card;
                if (solve(cards, 1, nums)) return true;
            } else {
                for (int j = 0; j < index; j++) {
                    double result = calculate(nums[j], (double) card);
                    nums[index] = result;
                    if (solve(cards, index + 1, nums)) return true;
                }
            }
            cards[i] = card;
        }
        return false;
    }

    private double calculate(double a, double b) {
        return a + b;
    }

    private double calculate(double a, double b, char op) {
        switch (op) {
            case '+':
                return a + b;
            case '-':
                return a - b;
            case '*':
                return a * b;
            case '/':
                if (b == 0) return Double.MAX_VALUE;
                return a / b;
            default:
                return 0;
        }
    }

    public boolean solve(int[] cards) {
        if (cards == null || cards.length != 4) {
            return false;
        }

        double[] nums = new double[4];
        for (int i = 0; i < 4; i++) {
            nums[i] = (double) cards[i];
        }

        return canReach24(nums);
    }

    private boolean canReach24(double[] nums) {
        if (nums.length == 1) {
            return Math.abs(nums[0] - 24) < 1e-6;
        }

        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                double a = nums[i];
                double b = nums[j];
                double[] nextNums = new double[nums.length - 2];
                int k = 0;
                for (int l = 0; l < nums.length; l++) {
                    if (l != i && l != j) {
                        nextNums[k++] = nums[l];
                    }
                }

                double[] results = new double[4];
                results[0] = a + b;
                results[1] = a - b;
                results[2] = a * b;
                if (b != 0) {
                    results[3] = a / b;
                }

                for (double result : results) {
                    double[] tempNums = new double[nums.length - 1];
                    int index = 0;
                    for (int l = 0; l < nums.length; l++) {
                        if (l != i && l != j) {
                            tempNums[index++] = nums[l];
                        }
                    }
                    tempNums[tempNums.length - 1] = result;
                    if (canReach24(tempNums)) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

