public class Solution {
    public List<Integer> fallingSquares(int[][] positions) {
        List<Integer> ans = new ArrayList<>();
        int globalMax = 0;
        List<int[]> heights = new ArrayList<>();

        for (int[] pos : positions) {
            int left = pos[0];
            int side = pos[1];
            int right = left + side;
            int height = side;

            for (int[] h : heights) {
                int hLeft = h[0];
                int hRight = h[1];
                int hHeight = h[2];

                if (left < hRight && right > hLeft) {
                    height = Math.max(height, hHeight + side);
