// #Medium #Math #Depth_First_Search #Breadth_First_Search #Bit_Manipulation
// #2022_03_22_Time_0_ms_(100.00%)_Space_38.9_MB_(80.85%)
import java.util.HashSet;
import java.util.Set;

public class Solution {
    public int flipLights(int n, int m) {
        Set<Integer> states = new HashSet<>();
        dfs(n, m, 0, states);
        return states.size();
    }

    private void dfs(int n, int presses, int currentStatus, Set<Integer> states) {
        if (presses == 0) {
            states.add(currentStatus);
            return;
        }

        // Button 1: Flip all bulbs
        dfs(n, presses - 1, currentStatus ^ ((1 << n) - 1), states);

        // Button 2: Flip even bulbs
        dfs(n, presses - 1, currentStatus ^ ((1 << n) - 1) & ~((1 << n) - 1)), states);

        // Button 3: Flip odd bulbs
        dfs(n, presses - 1, currentStatus ^ ((1 << n) - 1) & (1 << n) - 1), states);

        // Button 4: Flip bulbs j = 3k + 1
        int mask = 0;
        for (int i = 0; i < n; i++) {
            if ((i + 1) % 3 == 1) {
                mask |= (1 << i);
            }
        }
        dfs(n, presses - 1, currentStatus ^ mask, states);
    }
}

