public class Solution {
    public String solveEquation(String equation) {
        String[] parts = equation.split("=");
        String left = parts[0];
        String right = parts[1];

        int[] leftCoeff = parseSide(left);
        int[] rightCoeff = parseSide(right);

        int xCoeff = leftCoeff[0] - rightCoeff[0];
        int constant = leftCoeff[1] - rightCoeff[1];

        if (xCoeff == 0) {
            if (constant == 0) {
                return "Infinite solutions";
            } else {
                return "No solution";
            }
        } else {
            int xValue = constant / xCoeff;
            if (constant % xCoeff != 0) {
                return "No solution";
            }
            return "x=" + xValue;
        }
    }

    private int[] parseSide(String side) {
        int xCoeff = 0;
        int constant = 0;
        String[] terms = side.split("[+\\-]");
        String[] signs = side.split("(?=[+\\-])");

        for (int i = 0; i < terms.length; i++) {
            String term = terms[i];
            String sign = signs[i].trim();

            if (term.contains("x")) {
                int coeff = 1;
                if (term.length() > 1 && term.charAt(0) != 'x') {
                    coeff = Integer.parseInt(term.substring(0, term.indexOf("x")));
                }
                if (sign.equals("-")) {
                    xCoeff -= coeff;
                } else {
                    xCoeff += coeff;
                }
            } else {
                int num = Integer.parseInt(term);
                if (sign.equals("-")) {
                    constant -= num;
                } else {
                    constant += num;
                }
            }
