import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
public class Solution {
    public int shoppingPossibilities(int[] price, int[] needs, List<List<Integer>> special) {
        int n = price.length;
        Map<String, Integer> memo = new HashMap<>();

        return solve(price, needs, special, 0, memo);
    }

    private int solve(int[] price, int[] needs, List<List<Integer>> special, int mask, Map<String, Integer> memo) {
        String key = mask + "";
        if (memo.containsKey(key)) {
            return memo.get(key);
        }

        int n = price.length;
        boolean allBought = true;
        for (int i = 0; i < n; i++) {
            if ((mask & (1 << i)) == 0) {
                allBought = false;
                break;
            }
        }

        if (allBought) {
            return 0;
        }

        int minPrice = Integer.MAX_VALUE;

        // Option 1: Buy one item at a time
        for (int i = 0; i < n; i++) {
            if ((mask & (1 << i)) == 0) {
                int newMask = mask | (1 << i);
                int priceToPay = price[i] + solve(price, needs, special, newMask, memo);
                minPrice = Math.min(minPrice, priceToPay);
            }
        }

        // Option 2: Use a special offer
        for (List<Integer> offer : special) {
            boolean canApply = true;
            int newMask = mask;
            for (int i = 0; i < n; i++) {
                int offerCount = offer.get(i);
                if (offerCount > 0) {
                    if ((mask & (1 << i)) != 0) {
                        canApply = false;
                        break;
                    }
                }
            }

            if (canApply) {
                for (int i = 0; i < n; i++) {
                    int offerCount = offer.get(i);
                    if (offerCount > 0) {
                        newMask |= (1 << i);
                    }
                }
                int offerPrice = offer.get(n);
                int priceToPay = offerPrice + solve(price, needs, special, newMask, memo);
                minPrice = Math.min(minPrice, priceToPay);
            }
        }

        memo.put(key, minPrice);
        return minPrice;
    }
}

