import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.LinkedList;
import java.util.List;
public class Solution {
    public List<List<String>> printTree(TreeNode root) {
        int height = getHeight(root);
        int m = height + 1;
        int n = (int) Math.pow(2, height + 1) - 1;
        List<List<String>> res = new ArrayList<>();
        for (int i = 0; i < m; i++) {
            List<String> row = new ArrayList<>();
            for (int j = 0; j < n; j++) {
                row.add("");
            }
            res.add(row);
        }

        dfs(root, res, 0, (n - 1) / 2, height);
        return res;
    }

    private void dfs(TreeNode node, List<List<String>> res, int row, int col, int height) {
        if (node == null) {
            return;
        }

        res.get(row).set(col, String.valueOf(node.val));

        if (row + 1 < res.size()) {
            int leftCol = col - (int) Math.pow(2, height - row - 1);
            int rightCol = col + (int) Math.pow(2, height - row - 1);

            if (leftCol >= 0 && leftCol < res.get(0).size()) {
                dfs(node.left, res, row + 1, leftCol, height);
            }
            if (rightCol >= 0 && rightCol < res.get(0).size()) {
                dfs(node.right, res, row + 1, rightCol, height);
            }
        }
    }

    private int getHeight(TreeNode root) {
        if (root == null) {
            return -1;
        }
        return 1 + Math.max(getHeight(root.left), getHeight(root.right));
    }
}

