            } else {
                return a.compareTo(b);
            }
        });

        sortedWords.addAll(frequencyMap.keySet());

        Iterator<String> iterator = sortedWords.iterator();
        for (int i = 0; i < k && iterator.hasNext(); i++) {
            result.add(iterator.next());
        }

        return result;
    }
}

