import java.util.Arrays;
public class Solution {
    public int maximumGap(int[] nums) {
        if (nums == null || nums.length < 2) {
            return 0;
        }

        int n = nums.length;
        int minVal = nums[0];
        int maxVal = nums[0];

        for (int num : nums) {
            minVal = Math.min(minVal, num);
            maxVal = Math.max(maxVal, num);
        }

        if (minVal == maxVal) {
            return 0;
        }

        int bucketSize = (maxVal - minVal) / (n - 1);
        if (bucketSize == 0) {
            bucketSize = 1;
        }

        int[] bucketsMin = new int[bucketSize];
        int[] bucketsMax = new int[bucketSize];
        Arrays.fill(bucketsMin, Integer.MAX_VALUE);
        Arrays.fill(bucketsMax, Integer.MIN_VALUE);

        for (int num : nums) {
            int bucketIndex = (num - minVal) / bucketSize;
            bucketsMin[bucketIndex] = Math.min(bucketsMin[bucketIndex], num);
            bucketsMax[bucketIndex] = Math.max(bucketsMax[bucketIndex], num);
        }

        int maxGap = 0;
        int prevMax = bucketsMax[0];
        for (int i = 1; i < bucketSize; i++) {
            if (bucketsMin[i] == Integer.MAX_VALUE) {
                continue;
            }
            maxGap = Math.max(maxGap, bucketsMin[i] - prevMax);
            prevMax = bucketsMax[i];
        }

        return maxGap;
    }
}

