import java.util.Set;
public class Solution {
    public List<String> wordBreak(String s, List<String> wordDict) {
        Set<String> wordSet = new HashSet<>(wordDict);
        List<String> result = new LinkedList<>();
        wordBreakHelper(s, wordSet, 0, new StringBuilder(), result);
        return result;
    }

    private void wordBreakHelper(String s, Set<String> wordSet, int start, StringBuilder current, List<String> result) {
        if (start == s.length()) {
            result.add(current.toString().trim());
            return;
        }

        for (int end = start + 1; end <= s.length(); end++) {
            String prefix = s.substring(start, end);
            if (wordSet.contains(prefix)) {
                StringBuilder newCurrent = new StringBuilder(current);
                newCurrent.append(prefix).append(" ");
                wordBreakHelper(s, wordSet, end, newCurrent, result);
            }
        }
    }
}

