import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int maxPoints(int[][] points) {
        if (points == null || points.length == 0) {
            return 0;
        }

        int n = points.length;
        if (n <= 2) {
            return n;
        }

        int maxPoints = 0;

        for (int i = 0; i < n; i++) {
            Map<Double, Integer> slopeCount = new HashMap<>();
            int samePointCount = 1;
            int verticalCount = 0;

            for (int j = i + 1; j < n; j++) {
                if (points[i][0] == points[j][0] && points[i][1] == points[j][1]) {
                    samePointCount++;
                } else if (points[i][0] == points[j][0]) {
                    verticalCount++;
                } else {
                    double slope = (double) (points[j][1] - points[i][1]) / (points[j][0] - points[i][0]);
                    slopeCount.put(slope, slopeCount.getOrDefault(slope, 0) + 1);
                }
            }

            int maxSlopeCount = 0;
            for (int count : slopeCount.values()) {
                maxSlopeCount = Math.max(maxSlopeCount, count);
            }

            maxPoints = Math.max(maxPoints, Math.max(maxSlopeCount + samePointCount, verticalCount + samePointCount));
        }

        return maxPoints;
    }
}

