import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;
public class Solution {
    public TreeNode buildTree(int[] preorder, int[] inorder) {
        Map<Integer, Integer> inorderMap = new HashMap<>();
        for (int i = 0; i < inorder.length; i++) {
            inorderMap.put(inorder[i], i);
        }
        return buildTreeHelper(preorder, inorder, 0, 0, inorder.length - 1);
    }

    private TreeNode buildTreeHelper(int[] preorder, int[] inorder, int preorderIndex, int inorderStart, int inorderEnd) {
        if (inorderStart > inorderEnd) {
            return null;
        }

        int rootVal = preorder[preorderIndex];
        TreeNode root = new TreeNode(rootVal);

        int inorderRootIndex = inorderMap.get(rootVal);

        root.left = buildTreeHelper(preorder, inorder, preorderIndex + 1, inorderStart, inorderRootIndex - 1);
        root.right = buildTreeHelper(preorder, inorder, preorderIndex + 1 + (inorderRootIndex - inorderStart), inorderRootIndex + 1, inorderEnd);

        return root;
    }
}

