// #Hard #String #Dynamic_Programming #2022_06_23_Time_2_ms_(100.00%)_Space_40.2_MB_(99.14%)
public class Solution {
    public int numDistinct(String s, String t) {
        int n = s.length();
        int m = t.length();

        // dp[i][j] represents the number of distinct subsequences of s[0...j-1] which equals t[0...i-1]
        int[][] dp = new int[m + 1][n + 1];

        // Initialization:
        // If t is empty, there is always 1 way to form an empty string from s (by deleting all characters)
        for (int j = 0; j <= n; j++) {
            dp[0][j] = 1;
        }

        // If s is empty and t is not empty, there are 0 ways to form t from s
        for (int i = 1; i <= m; i++) {
            dp[i][0] = 0;
        }

        // Fill the dp table
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                if (t.charAt(i - 1) == s.charAt(j - 1)) {
                    dp[i][j] = dp[i - 1][j - 1] + dp[i][j - 1];
                } else {
                    dp[i][j] = dp[i][j - 1];
                }
            }
        }

        return dp[m][n];
    }
}

