        }

        int n = nodes.size();
        ListNode dummy = new ListNode(0);
        ListNode tail = dummy;

        int left = 0;
        int right = n - 1;

        while (left <= right) {
            if (left == right) {
                tail.next = nodes.get(left);
                tail = tail.next;
                break;
            }

            tail.next = nodes.get(left);
            tail = tail.next;

            tail.next = nodes.get(right);
            tail = tail.next;

            left++;
            right--;
        }

        tail.next = null;
        head = dummy.next;
    }
}

