public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) {
            return new ArrayList<>();
        }

        List<List<String>> result = new ArrayList<>();
        Queue<List<String>> queue = new LinkedList<>();
        queue.offer(Collections.singletonList(beginWord));

        int level = 0;
        Set<String> visited = new HashSet<>();
        visited.add(beginWord);

        while (!queue.isEmpty()) {
            int size = queue.size();
            Set<String> currentLevelWords = new HashSet<>();

            for (int i = 0; i < size; i++) {
                List<String> currentPath = queue.poll();
                String currentWord = currentPath.get(currentPath.size() - 1);
                currentLevelWords.add(currentWord);

                if (currentWord.equals(endWord)) {
                    result.add(new ArrayList<>(currentPath));
                    continue;
                }

                for (int j = 0; j < currentWord.length(); j++) {
                    char[] charArray = currentWord.toCharArray();
                    for (char c = 'a'; c <= 'z'; c++) {
                        charArray[j] = c;
                        String nextWord = new String(charArray);

                        if (wordSet.contains(nextWord) && !visited.contains(nextWord)) {
                            List<String> nextPath = new ArrayList<>(currentPath);
                            nextPath.add(nextWord);
                            queue.offer(nextPath);
                        }
                    }
                }
            }
            if (!result.isEmpty()) {
                break;
            }
            visited.addAll(currentLevelWords);
        }
        return result;
    }
}

