import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public boolean btreeGameWinningMove(TreeNode root, int n, int x) {
        if (n == 1) {
            return false;
        }

        for (int y = 1; y <= n; y++) {
            if (y != x) {
                if (canWin(root, n, x, y)) {
                    return true;
                }
            }
        }

        return false;
    }

    private boolean canWin(TreeNode root, int n, int x, int y) {
        TreeNode rootX = findNode(root, x);
        TreeNode rootY = findNode(root, y);

        if (rootX == null || rootY == null) {
            return false;
        }

        int score1 = 0;
        int score2 = 0;

        List<TreeNode> redNodes = new ArrayList<>();
        List<TreeNode> blueNodes = new ArrayList<>();

        redNodes.add(rootX);
        blueNodes.add(rootY);

        boolean player1Turn = true;

        while (true) {
            if (player1Turn) {
                TreeNode nextNode = null;
                for (TreeNode node : redNodes) {
                    List<TreeNode> neighbors = getNeighbors(node, root);
                    for (TreeNode neighbor : neighbors) {
                        if (!isColored(neighbor, redNodes, blueNodes)) {
                            nextNode = neighbor;
                            break;
                        }
                    }
                    if (nextNode != null) {
                        break;
                    }
                }

                if (nextNode == null) {
                    break;
                }

                redNodes.add(nextNode);
                score1++;
            } else {
                TreeNode nextNode = null;
                for (TreeNode node : blueNodes) {
                    List<TreeNode> neighbors = getNeighbors(node, root);
                    for (TreeNode neighbor : neighbors) {
                        if (!isColored(neighbor, redNodes, blueNodes)) {
                            nextNode = neighbor;
                            break;
                        }
                    }
                    if (nextNode != null) {
                        break;
                    }
                }

                if (nextNode == null) {
                    break;
                }

                blueNodes.add(nextNode);
                score2++;
            }

            player1Turn = !player1Turn;
        }

        return score1 < score2;
    }

    private TreeNode findNode(TreeNode root, int value) {
        if (root == null) {
            return null;
        }

        if (root.val == value) {
            return root;
        }

        TreeNode left = findNode(root.left, value);
        if (left != null) {
            return left;
        }

        TreeNode right = findNode(root.right, value);
        if (right != null) {
            return right;
        }

        return null;
    }

    private List<TreeNode> getNeighbors(TreeNode node, TreeNode root) {
        List<TreeNode> neighbors = new ArrayList<>();

        if (node.left != null) {
            neighbors.add(node.left);
        }
        if (node.right != null) {
            neighbors.add(node.right);
        }

        TreeNode parent = findParent(root, node);
        if (parent != null) {
            neighbors.add(parent);
        }

        return neighbors;
    }

    private TreeNode findParent(TreeNode root, TreeNode node) {
        if (root == null || root == node) {
            return null;
        }

        if ((root.left == node) || (root.right == node)) {
            return root;
        }

        TreeNode left = findParent(root.left, node);
        if (left != null) {
            return left;
        }

        TreeNode right = findParent(root.right, node);
        if (right != null) {
            return right;
        }

        return null;
    }

    private boolean isColored(TreeNode node, List<TreeNode> redNodes, List<TreeNode> blueNodes) {
        return redNodes.contains(node) || blueNodes.contains(node);
    }
}

