import java.util.Arrays;
public class Solution {
    public long maxStones(int[] piles) {
        int n = piles.length;
        long[][] dp = new long[n + 1][n + 1];

        for (int i = 0; i <= n; i++) {
            Arrays.fill(dp[i], -1);
        }

        return solve(piles, 0, 0, dp);
    }

    private long solve(int[] piles, int index, int m, long[][] dp) {
        if (index == piles.length) {
            return 0;
        }

        if (dp[index][m] != -1) {
            return dp[index][m];
        }

        long maxAlice = 0;
        for (int x = 1; x <= 2 * m && index + x <= piles.length; x++) {
            long currentSum = 0;
            for (int i = index; i < index + x; i++) {
                currentSum += piles[i];
            }

            long bobScore = solve(piles, index + x, Math.max(m, x), dp);
            maxAlice = Math.max(maxAlice, currentSum + bobScore);
        }

        dp[index][m] = maxAlice;
        return maxAlice;
    }
}

