public class Solution {
    public int[] smallestSufficientTeam(String[] skills, List<List<String>> people) {
        int n = skills.length;
        int m = people.size();

        Map<String, Integer> skillToIndex = new HashMap<>();
        for (int i = 0; i < n; i++) {
            skillToIndex.put(skills[i], i);
        }

        int[] dp = new int[1 << n];
        for (int i = 0; i < (1 << n); i++) {
            dp[i] = m + 1;
        }
        dp[0] = 0;

        int[][] personSkills = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (String skill : people.get(i)) {
                if (skillToIndex.containsKey(skill)) {
                    personSkills[i][skillToIndex.get(skill)] = 1;
                }
            }
        }

        for (int mask = 0; mask < (1 << n); mask++) {
            if (dp[mask] == m + 1) continue;

            for (int i = 0; i < m; i++) {
                int newMask = mask;
                for (int j = 0; j < n; j++) {
                    if (personSkills[i][j] == 1) {
                        newMask |= (1 << j);
                    }
                }

                dp[newMask] = Math.min(dp[newMask], dp[mask] + 1);
            }
        }

        List<Integer> team = new ArrayList<>();
        int mask = (1 << n) - 1;
        while (mask > 0) {
            for (int i = 0; i < m; i++) {
                int newMask = 0;
                for (int j = 0; j < n; j++) {
                    if (personSkills[i][j] == 1) {
                        newMask |= (1 << j);
                    }
                }

                if ((newMask & mask) == newMask && dp[mask] == dp[mask ^ newMask] + 1) {
                    team.add(i);
                    mask ^= newMask;
                    break;
                }
            }
        }

        int[] result = new int[team.size()];
        for (int i = 0; i < team.size(); i++) {
            result[i] = team.get(i);
        }

        return result;
    }
}

