import java.util.Stack;

public class Solution {
    public boolean parseBoolExpr(String expression) {
        Stack<Boolean> stack = new Stack<>();
        for (char c : expression.toCharArray()) {
            if (c == 't') {
                stack.push(true);
            } else if (c == 'f') {
                stack.push(false);
            } else if (c == '!') {
                Boolean top = stack.pop();
                stack.push(!top);
            } else if (c == '&') {
                continue;
            } else if (c == '|') {
                continue;
            } else if (c == ',') {
                continue;
            } else if (c == ')') {
                boolean result = true;
                while (true) {
                    Boolean val = stack.pop();
                    if (val == null) break;
                    if (expression.charAt(expression.indexOf(')', expression.indexOf(')', 0)) - 1) == '&') {
                        result &= val;
                    } else {
                        result |= val;
                    }
                }
                stack.push(result);
            }
        }
        return stack.pop();
    }
}

