public class Solution {
    public String lastSubstring(String s) {
        int n = s.length();
        int start = 0;
        for (int i = 1; i < n; i++) {
            int j = 0;
            while (i + j < n && s.charAt(start + j) == s.charAt(i + j)) {
                j++;
            }
            if (i + j < n && s.charAt(start + j) < s.charAt(i + j)) {
                start = i;
            }
        }
        return s.substring(start);
    }
}

