// #Easy #Math #2022_06_13_Time_0_ms_(100.00%)_Space_40.2_MB_(64.71%)
public class Solution {
    public int numPrimeArrangements(int n) {
        long primeCount = 0;
        for (int i = 2; i <= n; i++) {
            if (isPrime(i)) {
                primeCount++;
            }
        }

        long mod = 1000000007;
        long factorialPrime = factorial(primeCount, mod);
        long factorialNonPrime = factorial(n - primeCount, mod);

        return (int) ((factorialPrime * factorialNonPrime) % mod);
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }

    private long factorial(long n, long mod) {
        long result = 1;
        for (long i = 2; i <= n; i++) {
            result = (result * i) % mod;
        }
        return result;
    }
}

