// #Medium #Array #Dynamic_Programming #2022_03_03_Time_6_ms_(73.85%)_Space_59.8_MB_(30.38%)
public class Solution {
    public int kConcatenationMaxSum(int[] arr, int k) {
        long mod = 1000000007;
        long kadane = Kadane(arr);
        long sum = 0;
        for (int num : arr) {
            sum += num;
        }

        if (k == 1) {
            return (int) (kadane % mod);
        } else {
            long ans;
            if (sum >= 0) {
                ans = (kadane + (sum * (k - 1)) % mod) % mod;
            } else {
                long kadane2 = Kadane(new int[]{arr[0], arr[1]});
                ans = Math.max(0, kadane2);
            }
            return (int) ans;
        }
    }

    private long Kadane(int[] arr) {
        long maxSoFar = 0;
        long currentMax = 0;
        for (int num : arr) {
            currentMax += num;
            if (currentMax < 0) {
                currentMax = 0;
            }
            maxSoFar = Math.max(maxSoFar, currentMax);
        }
        return maxSoFar;
    }
}

