import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode lcaDeepestLeaves(TreeNode root) {
        int[] depth = new int[1];
        TreeNode[] result = new TreeNode[1];
        dfs(root, 0, depth, result);
        return result[0];
    }

    private void dfs(TreeNode node, int d, int[] depth, TreeNode[] result) {
        if (node == null) {
            return;
        }

        if (node.left == null && node.right == null) {
            if (d > depth[0]) {
                depth[0] = d;
                result[0] = node;
            }
        } else {
            dfs(node.left, d + 1, depth, result);
            dfs(node.right, d + 1, depth, result);
        }
    }
}

