public class Solution {
    public List<String> invalidTransactions(String[] transactions) {
        List<String> invalid = new ArrayList<>();
        Map<String, List<Integer>> transactionMap = new HashMap<>();

        for (int i = 0; i < transactions.length; i++) {
            String[] parts = transactions[i].split(",");
            String name = parts[0];
            int time = Integer.parseInt(parts[1]);
            int amount = Integer.parseInt(parts[2]);
            String city = parts[3];

            if (amount > 1000) {
                invalid.add(transactions[i]);
                continue;
            }

            if (!transactionMap.containsKey(name)) {
                transactionMap.put(name, new ArrayList<>());
            }

            for (int prevTime : transactionMap.get(name)) {
                if (Math.abs(time - prevTime) <= 60 && !city.equals(parts[3])) {
                    invalid.add(transactions[i]);
                    break;
                }
            }

            transactionMap.get(name).add(time);
        }

        return invalid;
    }
