// #Medium #Array #Dynamic_Programming #Matrix #2023_06_01_Time_4_ms_(88.04%)_Space_44.7_MB_(17.39%)
public class Solution {
    public int largest1BorderedSquare(int[][] grid) {
        if (grid == null || grid.length == 0 || grid[0].length == 0) {
            return 0;
        }

        int rows = grid.length;
        int cols = grid[0].length;
        int maxSide = 0;

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
                if (grid[i][j] == 1) {
                    int side = 1;
                    while (i + side <= rows && j + side <= cols) {
                        boolean isSquare = true;
                        // Check top row
                        for (int k = j; k < j + side; k++) {
                            if (grid[i][k] == 0) {
                                isSquare = false;
                                break;
                            }
                        }
                        if (!isSquare) break;

                        // Check bottom row
                        for (int k = j; k < j + side; k++) {
                            if (grid[i + side - 1][k] == 0) {
                                isSquare = false;
                                break;
                            }
                        }
                        if (!isSquare) break;

                        // Check left column
                        for (int k = i; k < i + side; k++) {
                            if (grid[k][j] == 0) {
                                isSquare = false;
                                break;
                            }
                        }
                        if (!isSquare) break;

                        // Check right column
                        for (int k = i; k < i + side; k++) {
                            if (grid[k][j + side - 1] == 0) {
                                isSquare = false;
                                break;
                            }
                        }

                        if (isSquare) {
                            maxSide = Math.max(maxSide, side);
                            side++;
                        } else {
                            break;
                        }
                    }
                }
            }

        return maxSide;
    }
}

