// #Hard #String #Dynamic_Programming #Greedy #Two_Pointers #Hash_Function #Rolling_Hash
// #2023_06_01_Time_2_ms_(60.00%)_Space_43.4_MB_(20.00%)
public class Solution {
    public int longestDecomposition(String text) {
        int n = text.length();
        int k = 0;
        int left = 0;
        int right = n - 1;

        while (left <= right) {
            int len = 1;
            while (left + len <= right - len + 1) {
                if (text.substring(left, left + len).equals(text.substring(right - len + 1, right + 1))) {
                    k += 2;
                    left += len;
                    right -= len;
                    break;
                }
                len++;
            }
            if (left > right) {
                if (left == right) {
                    k++;
                }
                break;
            }
            if (len == 1 && !text.substring(left, left + len).equals(text.substring(right - len + 1, right + 1))) {
                k++;
                break;
            }
        }

        return k;
    }
}

