import java.util.ArrayList;
import java.util.Arrays;
import java.util.LinkedList;
import java.util.List;
import java.util.Queue;
public class Solution {
    public int[] shortestAlternatingPaths(int n, int[][] redEdges, int[][] blueEdges) {
        List<List<int[]>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }

        for (int[] edge : redEdges) {
            adj.get(edge[0]).add(new int[]{edge[1], 0}); // 0 for red
        }
        for (int[] edge : blueEdges) {
            adj.get(edge[0]).add(new int[]{edge[1], 1}); // 1 for blue
        }

        int[] answer = new int[n];
        Arrays.fill(answer, -1);
        answer[0] = 0;

        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{0, 0, -1}); // node, distance, prevColor

        boolean[][] visited = new boolean[n][2]; // visited[node][color]
        visited[0][0] = true;
        visited[0][1] = true;

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int node = curr[0];
            int dist = curr[1];
            int prevColor = curr[2];

            for (int[] neighbor : adj.get(node)) {
                int nextNode = neighbor[0];
                int nextColor = neighbor[1];

                if (nextColor != prevColor && !visited[nextNode][nextColor]) {
                    visited[nextNode][nextColor] = true;
                    if (answer[nextNode] == -1) {
                        answer[nextNode] = dist + 1;
                    }
                    queue.offer(new int[]{nextNode, dist + 1, nextColor});
                }
            }
        }

        return answer;
    }
}

