// #Medium #String #Hash_Table #2023_06_01_Time_1_ms_(48.92%)_Space_40.5_MB_(86.56%)
public class Solution {
    public String alphabetBoardPath(String target) {
        int row = 0;
        int col = 0;
        StringBuilder sb = new StringBuilder();

        for (char c : target.toCharArray()) {
            int targetRow = (c - 'a') / 5;
            int targetCol = (c - 'a') % 5;

            int rowDiff = targetRow - row;
            int colDiff = targetCol - col;

            if (rowDiff > 0) {
                for (int i = 0; i < rowDiff; i++) {
                    sb.append('D');
                }
            } else if (rowDiff < 0) {
                for (int i = 0; i < Math.abs(rowDiff); i++) {
                    sb.append('U');
                }
            }

            if (colDiff > 0) {
                for (int i = 0; i < colDiff; i++) {
                    sb.append('R');
                }
            } else if (colDiff < 0) {
                for (int i = 0; i < Math.abs(colDiff); i++) {
                    sb.append('L');
                }
            }

            sb.append('!');
            row = targetRow;
            col = targetCol;
        }

        return sb.toString();
    }
}

