// #Medium #Array #Math #2024_05_13_Time_1_ms_(100.00%)_Space_53_MB_(70.47%)
public class Solution {
    /**
     * Given two arrays of integers with equal lengths, return the maximum value of:
     * |arr1[i] - arr1[j]| + |arr2[i] - arr2[j]| + |i - j| where the maximum is taken over all 0 <= i, j < arr1.length.
     *
     * @param arr1 The first array of integers.
     * @param arr2 The second array of integers.
     * @return The maximum value of |arr1[i] - arr1[j]| + |arr2[i] - arr2[j]| + |i - j|.
     */
    public int solve(int[] arr1, int[] arr2) {
        int n = arr1.length;
        int maxVal = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int currentVal = Math.abs(arr1[i] - arr1[j]) + Math.abs(arr2[i] - arr2[j]) + Math.abs(i - j);
                maxVal = Math.max(maxVal, currentVal);
            }
        }
        return maxVal;
    }
}

