public class Solution {
    public int[] distributeCandies(int candies, int numPeople) {
        int[] result = new int[numPeople];
        int i = 0;
        int give = 1;
        while (candies > 0) {
            if (candies >= give) {
                result[i % numPeople] += give;
                candies -= give;
                give++;
            } else {
                result[i % numPeople] += candies;
                candies = 0;
            }
            i++;
        }
        return result;
    }
}

