import java.util.Arrays;
public class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        int[] answer = new int[queries.length];
        int[] wordFrequencies = new int[words.length];
        for (int i = 0; i < words.length; i++) {
            wordFrequencies[i] = frequency(words[i]);
        }
        Arrays.sort(wordFrequencies);
        for (int i = 0; i < queries.length; i++) {
            int queryFrequency = frequency(queries[i]);
            int count = 0;
            int left = 0;
            int right = words.length - 1;
            int index = words.length;
            while (left <= right) {
                int mid = left + (right - left) / 2;
                if (wordFrequencies[mid] < queryFrequency) {
                    count = mid + 1;
                    left = mid + 1;
                } else {
                    right = mid - 1;
                }
            }
            answer[i] = count;
        }
        return answer;
    }

    private int frequency(String s) {
        int[] charCounts = new int[26];
        for (char c : s.toCharArray()) {
            charCounts[c - 'a']++;
        }
        int minFrequency = Integer.MAX_VALUE;
        for (int count : charCounts) {
            if (count > 0) {
                minFrequency = Math.min(minFrequency, count);
            }
        }
        return minFrequency;
    }
}

