        if (start < destination) {
            for (int i = start; i < destination; i++) {
                dist1 += distance[i];
            }
        } else {
            for (int i = start; i < n; i++) {
                dist1 += distance[i];
            }
            for (int i = 0; i < destination; i++) {
                dist1 += distance[i];
            }
        }

        int dist2 = sum - dist1;

        return Math.min(dist1, dist2);
    }
}

