public class Solution {
    public int numberOfUniqueGoodSubsequences(String binary) {
        int MOD = 1000000007;
        int n = binary.length();
        long[] dp = new long[n + 1];
        dp[0] = 1;
        int lastZero = -1;
        int lastOne = -1;

        for (int i = 1; i <= n; i++) {
            char c = binary.charAt(i - 1);
            dp[i] = (2 * dp[i - 1]) % MOD;

            if (c == '0') {
                if (lastZero != -1) {
                    dp[i] = (dp[i] - dp[lastZero]) % MOD;
                    if (dp[i] < 0) {
                        dp[i] += MOD;
                    }
                }
                lastZero = i - 1;
            } else {
                if (lastOne != -1) {
                    dp[i] = (dp[i] - dp[lastOne]) % MOD;
                    if (dp[i] < 0) {
                        dp[i] += MOD;
                    }
                }
                lastOne = i - 1;
            }
        }

        long result = (dp[n] - 1 + MOD) % MOD;

        boolean hasZero = false;
        for(int i = 0; i < binary.length(); i++){
            if(binary.charAt(i) == '0'){
                hasZero = true;
                break;
            }
        }

        if(!hasZero){
            result = (result + 1) % MOD;
        }

        return (int) result;
    }
}

