    public int[][] rotateGrid(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        int layers = Math.min(m, n) / 2;

        for (int layer = 0; layer < layers; layer++) {
            int size = m - 2 * layer;
            int rotations = k % (size * 4);

            for (int i = 0; i < rotations; i++) {
                int temp = grid[layer][layer];

                // Move elements from left to top
                for (int j = layer; j < layer + size - 1; j++) {
                    grid[layer][j] = grid[layer][j + 1];
                }

                // Move elements from bottom to left
                for (int j = layer; j < layer + size - 1; j++) {
                    grid[j][layer + size - 1] = grid[j + 1][layer + size - 1];
                }

                // Move elements from right to bottom
                for (int j = layer + size - 1; j > layer; j--) {
                    grid[layer + size - 1][j] = grid[layer + size - 1][j - 1];
                }

                // Move elements from top to right
                for (int j = layer + size - 1; j > layer + 1; j--) {
                    grid[j][layer] = grid[j - 1][layer];
                }

                grid[layer + 1][layer] = temp;
            }
        }

        return grid;
    }
