                int compatibilityScore = calculateCompatibilityScore(students[studentIndex], mentors[mentorIndex]);
                int newScore = solve(students, mentors, studentIndex + 1, assignment, used, currentScore + compatibilityScore);
                maxScore = Math.max(maxScore, newScore);
                used[mentorIndex] = false;
            }
        }
        return maxScore;
    }

    private int calculateCompatibilityScore(int[] studentAnswers, int[] mentorAnswers) {
        int compatibilityScore = 0;
        for (int i = 0; i < studentAnswers.length; i++) {
            if (studentAnswers[i] == mentorAnswers[i]) {
