    public int[] longestObstacleCourseAtEachPosition(int[] obstacles) {
        int n = obstacles.length;
        int[] ans = new int[n];
        int[] tails = new int[n + 1];
        int len = 0;

        for (int i = 0; i < n; i++) {
            int obstacle = obstacles[i];
            int left = 0;
            int right = len;

            while (left < right) {
                int mid = (left + right) / 2;
                if (tails[mid] <= obstacle) {
                    left = mid + 1;
                } else {
                    right = mid;
                }
            }

