            int maxColIndex = findMaxColIndex(mat, mid);

            if (isPeak(mat, mid, maxColIndex)) {
                return new int[]{mid, maxColIndex};
            } else if (mat[mid][maxColIndex] < mat[mid - 1][maxColIndex]) {
                end = mid - 1;
            } else {
                start = mid + 1;
            }
        }

        return null;
    }

    private int findMaxColIndex(int[][] mat, int row) {
        int maxIndex = 0;
        for (int i = 1; i < mat[0].length; i++) {
            if (mat[row][i] > mat[row][maxIndex]) {
                maxIndex = i;
            }
        }
        return maxIndex;
    }

    private boolean isPeak(int[][] mat, int row, int col) {
        int rows = mat.length;
        int cols = mat[0].length;

        // Check top
        if (row > 0 && mat[row][col] <= mat[row - 1][col]) {
            return false;
        }

        // Check bottom
        if (row < rows - 1 && mat[row][col] <= mat[row + 1][col]) {
            return false;
        }

        // Check left
        if (col > 0 && mat[row][col] <= mat[row][col - 1]) {
            return false;
        }

        // Check right
        if (col < cols - 1 && mat[row][col] <= mat[row][col + 1]) {
            return false;
        }

        return true;
    }
}

