// #2022_05_21_Time_480_ms_(90.78%)_Space_53.7_MB_(66.51%)
public class Solution {
    public int minimizeTheDifference(int[][] mat, int target) {
        int m = mat.length;
        int[] sums = new int[m];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < mat[i].length; j++) {
                sums[i] += mat[i][j];
            }
        }

        int n = mat[0].length;
        int minDiff = Integer.MAX_VALUE;

        for (int i = 0; i < (1 << (m * n)); i++) {
            int currentSum = 0;
            boolean valid = true;
            int[] chosen = new int[m];

            for (int row = 0; row < m; row++) {
                int index = -1;
                for (int col = 0; col < n; col++) {
                    if ((i & (1 << (row * n + col))) != 0) {
                        if (index != -1) {
                            valid = false;
                            break;
                        }
                        index = col;
                        chosen[row] = mat[row][col];
                    }
                }
                if (!valid) break;
            }

            if (valid) {
                currentSum = 0;
                for (int j = 0; j < m; j++) {
                    currentSum += chosen[j];
                }
                minDiff = Math.min(minDiff, Math.abs(target - currentSum));
            }
        }

        return minDiff;
    }
}

