            return new int[0][];
        }

        int m = land.length;
        int n = land[0].length;
        List<int[]> groups = new ArrayList<>();
        boolean[][] visited = new boolean[m][n];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (land[i][j] == 1 && !visited[i][j]) {
                    int r1 = i;
                    int c1 = j;
                    int r2 = i;
