                    dfs(land, i, j, visited, r1, c1, r2, c2);
                    groups.add(new int[]{r1, c1, r2, c2});
                }
            }
        }

        return groups.toArray(new int[0][]);
    }

    private void dfs(int[][] land, int r, int c, boolean[][] visited, int r1, int c1, int r2, int c2) {
        if (r < 0 || r >= land.length || c < 0 || c >= land[0].length || land[r][c] == 0 || visited[r][c]) {
            return;
        }

        visited[r][c] = true;
        r1 = Math.min(r1, r);
        c1 = Math.min(c1, c);
        r2 = Math.max(r2, r);
        c2 = Math.max(c2, c);

        dfs(land, r + 1, c, visited, r1, c1, r2, c2);
        dfs(land, r - 1, c, visited, r1, c1, r2, c2);
        dfs(land, r, c + 1, visited, r1, c1, r2, c2);
        dfs(land, r, c - 1, visited, r1, c1, r2, c2);
