            int timeFromMidnightToLogout = logoutTotalMinutes;
            rounds += timeFromMidnightToLogout / 15;
        } else {
            int duration = logoutTotalMinutes - loginTotalMinutes;
            rounds = duration / 15;
        }

        return rounds;
    }
