import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;
public class Solution {
    public int countPalindromicSubsequence(String s) {
        int n = s.length();
        int count = 0;
        Map<Character, Integer> firstOccurrence = new HashMap<>();
        Map<Character, Integer> lastOccurrence = new HashMap<>();

        for (int i = 0; i < n; i++) {
            char c = s.charAt(i);
            if (!firstOccurrence.containsKey(c)) {
                firstOccurrence.put(c, i);
            }
            lastOccurrence.put(c, i);
        }

        for (int i = 0; i < n; i++) {
            char mid = s.charAt(i);
            int left = firstOccurrence.get(mid) - 1;
            int right = lastOccurrence.get(mid) + 1;

            int distinctLeft = 0;
            boolean[] seen = new boolean[26];
            for (int j = 0; j < left; j++) {
                char c = s.charAt(j);
                if (!seen[c - 'a']) {
                    distinctLeft++;
                    seen[c - 'a'] = true;
                }
            }

            int distinctRight = 0;
            seen = new boolean[26];
            for (int j = right; j < n; j++) {
                char c = s.charAt(j);
                if (!seen[c - 'a']) {
                    distinctRight++;
                    seen[c - 'a'] = true;
                }
            }

            count = (count + distinctLeft * distinctRight) % 1000000007;
        }

        return count;
    }
}

