import java.util.List;
import java.util.Map;
import java.util.Queue;
public class Solution {
    public TreeNode canMerge(List<TreeNode> trees) {
        if (trees == null || trees.size() == 0) {
            return null;
        }
        if (trees.size() == 1) {
            return trees.get(0);
        }

        Map<Integer, TreeNode> rootMap = new HashMap<>();
        for (TreeNode root : trees) {
            rootMap.put(root.val, root);
        }

        TreeNode root = trees.get(0);
        return canMergeHelper(root, rootMap, trees);
    }

    private TreeNode canMergeHelper(TreeNode root, Map<Integer, TreeNode> rootMap, List<TreeNode> trees) {
        if (root == null) {
            return null;
        }

        TreeNode left = canMergeHelper(root.left, rootMap, trees);
        TreeNode right = canMergeHelper(root.right, rootMap, trees);

        if (left == null && right == null) {
            return root;
        }

        if (left == null) {
            if (right.val > root.val) {
                root.right = right;
                return root;
            } else {
                return null;
            }
        }

        if (right == null) {
            if (left.val < root.val) {
                root.left = left;
                return root;
            } else {
                return null;
            }
        }

        if (left.val < root.val && right.val > root.val) {
            root.left = left;
            root.right = right;
            return root;
        } else {
            return null;
        }
    }
}

