import java.math.BigInteger;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
public class Solution {
    public int waysToBuildRooms(int[] prevRoom) {
        int n = prevRoom.length;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        int[] inDegree = new int[n];
        for (int i = 0; i < n; i++) {
            if (prevRoom[i] != -1) {
                adj.get(prevRoom[i]).add(i);
                inDegree[i]++;
            }
        }

        long MOD = 1000000007;
        long[] dp = new long[n];
        dp[0] = 1;

        for (int i = 1; i < n; i++) {
            if (inDegree[i] == 0) {
                for (int j = 0; j < i; j++) {
                    if (inDegree[j] == 0) continue;
                    if (isReachable(j, i, adj)) {
                        dp[i] = (dp[i] + dp[j]) % MOD;
                    }
                }
                if (dp[i] == 0) {
                    dp[i] = 1;
                }
            }
        }

        long result = 0;
        for (int i = 0; i < n; i++) {
            if (inDegree[i] == 0) {
                result = (result + dp[i]) % MOD;
            }
        }

        if (result == 0) {
            return 1;
        }

        return (int) result;
    }

    private boolean isReachable(int start, int end, List<List<Integer>> adj) {
        boolean[] visited = new boolean[adj.size()];
        return dfs(start, end, adj, visited);
    }

    private boolean dfs(int current, int end, List<List<Integer>> adj, boolean[] visited) {
        if (current == end) {
            return true;
        }
        visited[current] = true;
        for (int neighbor : adj.get(current)) {
            if (!visited[neighbor]) {
                if (dfs(neighbor, end, adj, visited)) {
                    return true;
                }
            }
        }
        return false;
    }
}

