public class Solution {
    public int minSpaceWastedKResizing(int[] arr, int k) {
        int n = arr.length;
        int[][] dp = new int[n + 1][k + 2];
        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= k + 1; j++) {
                dp[i][j] = Integer.MAX_VALUE;
            }
        }
        dp[0][0] = 0;

        int[] maxVal = new int[n + 1];
        maxVal[0] = 0;
        for (int i = 1; i <= n; i++) {
            maxVal[i] = Math.max(maxVal[i - 1], arr[i - 1]);
        }

        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= k + 1; j++) {
                if (dp[i - 1][j] != Integer.MAX_VALUE) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][j] + (maxVal[i] - arr[i - 1]));
                }
                if (j > 0 && dp[i - 1][j - 1] != Integer.MAX_VALUE) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][j - 1] + (maxVal[i] - arr[i - 1]));
                }
            }
        }

        int minWasted = Integer.MAX_VALUE;
        for (int j = 0; j <= k; j++) {
            minWasted = Math.min(minWasted, dp[n][j]);
        }

        return minWasted;
    }
}

