// #2022_05_12_Time_15_ms_(94.29%)_Space_125_MB_(11.43%)
public class Solution {
    private static final int MOD = 1000000007;

    public int countGoodSubsets(int[] nums) {
        int n = nums.length;
        int maxNum = 0;
        for (int num : nums) {
            maxNum = Math.max(maxNum, num);
        }

        boolean[] isPrime = new boolean[maxNum + 1];
        for (int i = 2; i <= maxNum; i++) {
            isPrime[i] = true;
        }
        for (int i = 2; i * i <= maxNum; i++) {
            if (isPrime[i]) {
                for (int j = i * i; j <= maxNum; j += i) {
                    isPrime[j] = false;
                }
            }
        }

        int[] primeCounts = new int[20];
        for (int num : nums) {
            if (isPrime[num]) {
                primeCounts[num]++;
            }
        }

        long[] dp = new long[1 << 20];
        dp[0] = 1;

        for (int i = 2; i <= maxNum; i++) {
            if (isPrime[i]) {
                int index = 0;
                for (int j = 2; j <= maxNum; j++) {
                    if (isPrime[j] && j == i) {
                        index = j - 2;
                        break;
                    }
                }

                for (int mask = (1 << 20) - 1; mask >= 0; mask--) {
                    if ((mask & (1 << index)) == 0) {
                        dp[mask | (1 << index)] = (dp[mask | (1 << index)] + dp[mask] * primeCounts[i]) % MOD;
                    }
                }
            }
        }

        long result = 0;
        for (int mask = 1; mask < (1 << 20); mask++) {
            result = (result + dp[mask]) % MOD;
        }

        return (int) result;
    }
}

