public class Solution {
    public int latestDayToCross(int row, int col, int[][] cells) {
        int left = 1, right = cells.length;
        int ans = 0;
        while (left <= right) {
            int mid = (left + right) / 2;
            if (canCross(row, col, cells, mid)) {
                ans = mid;
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return ans;
    }

    private boolean canCross(int row, int col, int[][] cells, int day) {
        int[][] grid = new int[row][col];
        for (int i = 0; i < day; i++) {
            int r = cells[i][0] - 1;
            int c = cells[i][1] - 1;
            grid[r][c] = 1;
        }

        boolean[] visited = new boolean[row * col];
        return dfs(grid, visited, 0, 0);
    }

    private boolean dfs(int[][] grid, boolean[] visited, int r, int c) {
        if (r < 0 || r >= grid.length || c < 0 || c >= grid[0].length || grid[r][c] == 1 || visited[r * grid[0].length + c]) {
            return false;
        }

        if (r == grid.length - 1) {
            return true;
        }

        visited[r * grid[0].length + c] = true;

        return dfs(grid, visited, r + 1, c) || dfs(grid, visited, r - 1, c) ||
                dfs(grid, visited, r, c + 1) || dfs(grid, visited, r, c - 1);
    }
}

