// #Hard #String #Hash_Function #Rolling_Hash #2022_05_20_Time_32_ms_(75.00%)_Space_44.7_MB_(91.67%)
public class Solution {
    public long maxProduct(String s) {
        int n = s.length();
        long maxProduct = 0;

        for (int i = 0; i < n; i++) {
            // Find odd length palindromes starting at index i
            for (int j = i; j < n; j++) {
                if ((j - i + 1) % 2 != 0 && isPalindrome(s, i, j)) {
                    // Find odd length palindromes after the first palindrome
                    for (int k = j + 1; k < n; k++) {
                        for (int l = k; l < n; l++) {
                            if ((l - k + 1) % 2 != 0 && isPalindrome(s, k, l)) {
                                maxProduct = Math.max(maxProduct, (long) (j - i + 1) * (l - k + 1));
                            }
                        }
                    }
                }
            }
        }

        return maxProduct;
    }

    private boolean isPalindrome(String s, int start, int end) {
        while (start < end) {
            if (s.charAt(start) != s.charAt(end)) {
                return false;
            }
            start++;
            end--;
        }
        return true;
    }
}

