import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
import java.util.PriorityQueue;
public class Solution {
    public int minCost(int maxTime, int[][] edges, int[] passingFees) {
        int n = passingFees.length;
        Map<Integer, List<int[]>> adj = new HashMap<>();
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            int time = edge[2];
            adj.computeIfAbsent(u, k -> new ArrayList<>()).add(new int[]{v, time});
            adj.computeIfAbsent(v, k -> new ArrayList<>()).add(new int[]{u, time});
        }

        int[][] dp = new int[n][maxTime + 1];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = passingFees[0];

        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        pq.offer(new int[]{0, 0, passingFees[0]});

        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int u = curr[0];
            int time = curr[1];
            int cost = curr[2];

            if (cost > dp[u][time]) {
                continue;
            }

            if (u == n - 1) {
                continue;
            }

            if (adj.containsKey(u)) {
                for (int[] neighbor : adj.get(u)) {
                    int v = neighbor[0];
                    int travelTime = neighbor[1];

                    if (time + travelTime <= maxTime) {
                        int newCost = cost + passingFees[v];
                        if (newCost < dp[v][time + travelTime]) {
                            dp[v][time + travelTime] = newCost;
                            pq.offer(new int[]{v, time + travelTime, newCost});
                        }
                    }
                }
            }
        }

        int minCost = Integer.MAX_VALUE;
        for (int time = 0; time <= maxTime; time++) {
            minCost = Math.min(minCost, dp[n - 1][time]);
        }

        return minCost == Integer.MAX_VALUE ? -1 : minCost;
    }
}

