import java.util.HashSet;
public class Solution {
    public int longestCommonSubpath(int n, int[][] paths) {
        if (paths == null || paths.length == 0) {
            return 0;
        }

        int minLen = Integer.MAX_VALUE;
        for (int[] path : paths) {
            minLen = Math.min(minLen, path.length);
        }

        int low = 0;
        int high = minLen;
        int result = 0;

        while (low <= high) {
            int mid = low + (high - low) / 2;
            if (check(paths, mid)) {
                result = mid;
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }

        return result;
    }

    private boolean check(int[][] paths, int len) {
        if (len == 0) {
            return true;
        }

        HashSet<Integer> set = new HashSet<>();
        for (int i = 0; i <= paths[0].length - len; i++) {
            int hash = 0;
            for (int j = i; j < i + len; j++) {
                hash = hash * 31 + paths[0][j];
            }
            set.add(hash);
        }

        for (int i = 1; i < paths.length; i++) {
            HashSet<Integer> currentSet = new HashSet<>();
            for (int j = 0; j <= paths[i].length - len; j++) {
                int hash = 0;
                for (int k = j; k < j + len; k++) {
                    hash = hash * 31 + paths[i][k];
                }
                currentSet.add(hash);
            }

            HashSet<Integer> intersection = new HashSet<>(currentSet);
            intersection.retainAll(set);

            if (intersection.isEmpty()) {
                return false;
            }
        }

        return true;
    }
}

package referenz;

import java.util.Stack;

// #Hard #Array #Stack #Monotonic_Stack #2022_05_18_Time_9_ms_(99.65%)_Space_160.6_MB_(44.01%)
public class Solution {
    public int[] canSeePersonsCount(int[] heights) {
        int n = heights.length;
        int[] answer = new int[n];
        Stack<Integer> stack = new Stack<>();

        for (int i = n - 1; i >= 0; i--) {
            int count = 0;
            while (!stack.isEmpty() && heights[i] > heights[stack.peek()]) {
                stack.pop();
                count++;
            }
            if (!stack.isEmpty()) {
                count++;
            }
            answer[i] = count;
            stack.push(i);
        }

        return answer;
    }
}

package referenz;

import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int nearestExit(char[][] maze, int[] entrance) {
        int m = maze.length;
        int n = maze[0].length;
        int startRow = entrance[0];
        int startCol = entrance[1];

        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{startRow, startCol, 0});
        maze[startRow][startCol] = '+'; // Mark as visited

        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

        while (!queue.isEmpty()) {
            int[] current = queue.poll();
            int row = current[0];
            int col = current[1];
            int steps = current[2];

            if (row == 0 || row == m - 1 || col == 0 || col == n - 1) {
                if (row != startRow || col != startCol) {
                    return steps;
                }
            }

            for (int[] dir : directions) {
                int newRow = row + dir[0];
                int newCol = col + dir[1];

                if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n && maze[newRow][newCol] == '.') {
                    maze[newRow][newCol] = '+'; // Mark as visited
                    queue.offer(new int[]{newRow, newCol, steps + 1});
                }
            }
        }

        return -1;
    }
}
